('cast_211MQfo0U68JTwGkddYHD2yOPhPEgbb4gL', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 2, 'Terry Crews', 'terry-crews', '', '53256', 'nm0187719', 'terrycrews', 'terrycrews', 'https://www.themoviedb.org/t/p/w300/mmmnIKDPeNuXcQDOl6nQDuh63nV.jpg', 0, 1, 'Flint, Michigan, USA ', '1968-07-30', '#', '2021-08-02 14:41:05', '2021-08-02 14:41:06'),
('cast_211sEWeRFjc1NIdlSGCiz5C4pRQ6NVt0NE', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 2, 'Jason Statham', 'jason-statham', '26 Temmuz 1972 Londra doğumlu Jason Statham ailesinin mesleği nedeniyle sokak tiyatrosuyla erkenden tanıştı. Fakat bunun yanında spora yönelen ünlü aktrist İngiliz milli dalış takımının bir üyesi olarak katıldığı turnuvalarda dünya 12.liğine kadar yükseldi. Modellik yaptığı sıralarda İngiliz yönetmen Guy Ritchie ile tanışan Jason Statham oyunculuk kariyerine  “Bacon” adlı film ile giriş yaptı. 2000 yılında yine bir Guy Ritchie filmi olan Snatch’te Turkish karakterini oynayan Jason Statham’ın kariyeri 80 milyon hasılat gelirle oldukça güçlendi. Jason Statham’ın dövüş sanatları eğitimini sergileme fırsatı bulduğu Transporter serisi onu sinemaseverlerle buluşturdu ve Hollywood da dublör kullanmayan ender oyunculardan biri olan Jason Statham “The Italian Job” filminin dövüş sahnelerinde  neredeyse hiç dublör kullanmadı. Armond White gibi eleştirmenler tarafından yaptığı işler yeni ve devinimsel pop-art örnekleri olarak anılmaya başlayan Jason Statham’ın 2008 yılında başrollerini oynadığı Death Race ve Transporter 3 ‘te gösterdiği başarı bu övgüye layık olduğunu kanıtladı.The Expendables serisinde ki başarısından sonra Fast & Furious ile sahneye çıkan Jason Statham’ın 2010’dan beri model  Rosie Huntington-Whiteley ile evlidir. Ayrıca uzun yıllardır, Britanya Ulusal Dalgıçlığı\'nın bir üyesidir.', '976', 'nm0005458', '#', 'jasonstatham', 'https://www.themoviedb.org/t/p/w300/lldeQ91GwIVff43JBrpdbAAeYWj.jpg', 0, 1, 'Shirebrook, Derbyshire, England, UK', '1967-07-26', '#', '2021-08-02 14:54:38', '2021-08-02 14:54:39'),
