('cast_216y7lFByGoRU6ENdfiMGfNKkcZ4bwfxAq', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 2, 'Osman Sonant', 'osman-sonant', '1 Mart 1979 yılında İstanbul’da doğdu. 1997 yılında Bahçelievler Belediye Tiyatrosu\'nda Yılmaz Gruda\'dan aldığı oyunculuk eğitimi ile oyunculuğa ilk adımını atmıştır. Osman Sonant, 1998 yılında Ferhan Şensoy\'un yönetimindeki Orta oyuncular Nöbetçi Tiyatro\'da çalışmalarını devam ettirdi ve 1999 yılında girdiği İstanbul Üniversitesi Devlet Konservatuvarı Sahne Sanatları bölümünde oyunculuk lisans eğitimini tamamladı. Osman Sonant kamera karşısına da ilk kez Kurtlar Vadisi Irak isimli film ile geçti. Sonant, 2009 yılında, yönetmen Yeşim Ustaoğlu’nun Pandora\'nın kutusu adlı filmindeki Mehmet rolü ile 16. Altın Koza Film Festivali En İyi Yardımcı Erkek Oyuncu Ödülünü kazandı.', '1255122', 'nm2183200', 'osmansonant', 'sonantosman', 'https://www.themoviedb.org/t/p/w300/9qcoEuPRNO6vLSfBv05ZDXkrM2y.jpg', 0, 1, 'İstanbul,Türkiye ', '1979-03-01', '#', '2021-08-05 14:15:34', '2021-08-05 14:15:35'),
