('cast_2174AF9ThQo3mPLdLeddO1MZBWFyVdJfy7', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 2, 'Vin Diesel', 'vin-diesel', '18 Temmuz 1967 tarihinde New York’da doğan Vin Diesel’in gerçek adı Mark Sinclair Vincent’dir. 7 yaşında, arkadaşları ile gizlice bir tiyatroya girerler ve yakalanırlar. Her hafta tiyatroya gelerek küçük bir rol oynamakla cezalandırıldılar ve Vin Diesel’in ilk oyunculuk deneyimi böyle başlamış olur. Lise 3.sınıfta okulunu bırakıp Hollywood’a gitti. Hollywood’da başarıyı yakalayamadı ve bir yıl sonra New York’a döndü.  17 yaşında gece klüplerinde bodyguard olarak çalışmaya başladı ve yaklaşık 10 yıl kadar bunu devam ettirdi. İsmini de o zamanlarda Vin Diesel\'e çevirdi. Aktörlük tecrübelerini anlattığı bir kısa film yazdı; Multi-Facial (1994). Oradan Vin\'in kariyeri hızla gelişti ve ilk başrolünü \'Richard B Riddick\' olarak bilim kurgu filmi Pitch Black (2000)’le elde etti.  Büyük çıkış yakaladığı Hızlı ve Öfkeli film serisinde Dominic Toretto, Er Ryan\'ı Kurtarmak filminde Er Caparzo, xXx filminde Xander Cage, Pitch Black ve Richard B. Riddick filmlerinde Richard B. Riddick karakterlerini canlandırmıştır. Vin Diesel’in “One Race Productions” film şirketi  ve “Tigon Studios” adlı oyun şirketi vardır. Vin Diesel, model Pamole Jimenez ile evli ve Hanya Riley adında bir kız çocuk babasıdır.', '12835', 'nm0004874', 'vindiesel', 'vindiesel', 'https://www.themoviedb.org/t/p/w300/7rwSXluNWZAluYMOEWBxkPmckES.jpg', 0, 1, 'Alameda County, California, USA', '1967-07-18', '#', '2021-08-10 13:55:40', '2021-08-10 13:55:41'),
