('cast_219KwA5RMsIvCs3mtlgFiVrk8K4eUQSKMN', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 1, 'Rebecca Ferguson', 'rebecca-ferguson', 'Rebecca Louisa Ferguson Sundström İsveçli bir oyuncudur. Oyunculuk kariyerine İsveç pembe dizisi Nya tider (1999-2000) ile başladı ve Drowning Ghost (2004) filminde rol aldı. İngiliz televizyon mini dizileri The White Queen\'de (2013) Elizabeth Woodville\'i canlandırmasıyla uluslararası bir üne sahip oldu, bu rolünden dolayı, mini dizide veya televizyon filminde en iyi Kadın oyuncu dalında Altın Küre\'ye aday gösterildi.\n\nFerguson, casusluk filmi Görevimiz Tehlike 5 (2015) ve devamı olan Görevimiz Tehlike 6 (2018) filminde MI6 ajanı olarak rol aldı.', '933238', 'nm0272581', '#', 'officialrebeccaferguson', 'https://www.themoviedb.org/t/p/w300/4vbZcV22YmWhZqFsAbOkVauIoY7.jpg', 0, 1, 'Stockholm, Sweden', '1983-10-19', '#', '2021-08-25 18:28:38', '2021-08-25 18:28:38'),
