('cast_21FpVOKJ207S5S1FpBpawBrk4P2gz867Mq', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 2, 'Selim Bayraktar', 'selim-bayraktar', 'Türk baba ile Kerkük\'lü annenin çocuğu olarak doğan oyuncu, ilkokulu Kerkük\'te bitirmiş, 1987 yılında ailesi ile birlikte Türkiye\'ye gelmiştir. Önce Eskişehir ardından ise Antalya\'ya yerleşmiş ve lise eğitimini burada almıştır. 2000 yılında Hacettepe Üniversitesi Ankara Devlet Konservatuarı Tiyatro Bölümünden mezun olduktan sonra bir süre Diyarbakır Devlet Tiyatrosu\'nda çalışmıştır. 2007 yılında ise Antalya Devlet Tiyatrosu\'na geçmiştir. Othello, Sırça Kümes ve Bay Kolpert gibi oyunlarda oynadı. Televizyona ise ilk kez 2006 yılında, Köprü isimli dizide canlandırdığı Erdal karakteri ile adım atmıştır. Ardından 2009\'da Bir Bulut Olsam dizisinde Mahmut Paşa karakterini canlandırmıştır. 2011 yılında yayınlanmaya başlayan tarihi televizyon dizisi Muhteşem Yüzyıl\'da canlandırdığı Sümbül Ağa karakteri ile ünlenmiş, daha sonra Romantik Komedi 2: Bekarlığa Veda, Kırmızı ve Aşk Sana Benzer sinema filmlerinde oynamıştır. 2005 yılından beri Bihter Bayraktar ile evlidir.', '1253158', 'nm2515011', '#', 'selimbyraktar', 'https://www.themoviedb.org/t/p/w300/sraOnnVMZZRRsQdrWkHQseouVHK.jpg', 0, 1, 'Kirkuk, Iraq', '1975-06-17', '#', '2021-08-05 14:15:41', '2021-08-05 14:15:42'),
