('cast_21hk3uFJPrsK9uWv9luKSkHu8NnDjhIfhE', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 1, 'Adrienne Wilkinson', 'adrienne-wilkinson', '', '154963', 'nm0929330', '#', '#', 'https://www.themoviedb.org/t/p/w300/tp55UpZebeQFFMSNo8PMtEk9ANG.jpg', 0, 1, 'Memphis, Missouri, U.S.', '1977-09-01', '#', '2021-08-28 11:16:26', '2021-08-28 11:16:27'),
('cast_21hKEPJsMsQ82fPQwOtDudv2sKkJdNDRUt', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 1, 'Kotono Mitsuishi', 'kotono-mitsuishi', '', '77931', 'nm0594074', 'kotochawanmoon', '#', 'https://www.themoviedb.org/t/p/w300/1kqWHBmMGEjdyySvRPjh4ZHAnrm.jpg', 0, 1, ' Tokyo, Japan', '1967-12-08', '#', '2021-08-27 21:37:50', '2021-08-27 21:37:51'),
('cast_21HKQgKI8eQGesOC2RB8BdlLWPdckwX4O5', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 1, 'Emma Stone', 'emma-stone', 'Emily Jean \"Emma\" Stone (d. 6 Kasım 1988), Akademi ödüllü Amerikalı oyuncudur. 2010 yılında Adı Çıkmış filmiyle tanınmaya başlanıldı. 2014 yılında oynadığı Birdman filmiyle uluslararası alanda başarı sağladı. 2016 yılında oynadığı Aşıklar Şehri filmiyle olumlu yorumlar aldı.\n\nStone, ev hanımı Krista (evlilik öncesi soyadı Yeager) ve müteahhit olan Jeff Stone\'un kızı olarak doğdu. Kendisinden iki yaş genç bir erkek kardeşi bulunan Stone\'un, büyükbabası İsveç kökenliydi ve ailesinin soyadı Ellis Adası\'ndan ABD\'ye göç ederken \"Stone\" olarak İngilizce\'ye uyarlandı.\n\n11 yaşındayken, Söğütlükte Rüzgâr adlı oyunda ilk sahne deneyimini yaşadı. İki yıl evden eğitim gördü, bu esnada içlerinde The Princess and the Pea, Cinderella, Alice in Wonderland ve Joseph and the Amazing Technicolor Dreamcat oyunlarının bulunduğu Valley Youth Tiyatrosu\'ndaki 16 yapımda yer aldı.\n\nOyunculuk hayatının peşinden gitmek için Kaliforniya\'ya taşınmasına ikna etmek adına ailesine, \"Project Hollywood\" isimli Madonna\'nın \"Hollywood\" şarkısı hakkında hazırlanmış bir PowerPoint sunumu hazırladı. Liseyi bıraktı ve Ocak 2004\'te, 15 yaşındayken annesiyle Los Angeles\'taki bir apartmana taşındı ve gün içerisinde yetenek sınavlarını verebilmesi için evden eğitim gördü.\n\nScottsdale, Arizona\'da doğan ve büyüyen Stone, oyunculuk hayatına 2000 yılında çocukken oynadığı Söğütlükte Rüzgâr adlı tiyatro yapımı ile başladı. Gençliğinde annesiyle birlikte Los Angeles\'a taşındı ve televizyon hayatına 2005 yılında oynadığı The New Partridge Family adlı TV filmi ile başladı. Küçük televizyon rollerinden sonra 2007 yılında Çok Fena filmiyle sinema hayatına başladı ve Genç Hollywood Ödülü kazandı.\n\n2010 yılında ilk başrolü Adı Çıkmış filminde oynadı ve ilk Altın Küre adaylığını elde etti. 2011 yılında Çılgın Aptal Aşk ve Duyguların Rengi filmleriyle çıkışını sürdürdü. 2014 yılında Birdman filminde oynadı ve ilk Akademi adaylığını elde etti. 2016 yılında Aşıklar Şehri filmiyle Akademi, Altın Küre ve BAFTA ödüllerini kazandı.', '54693', 'nm1297015', '', '', 'https://www.themoviedb.org/t/p/w300/2hwXbPW2ffnXUe1Um0WXHG0cTwb.jpg', 0, 1, 'Scottsdale, Arizona, USA', '1988-11-06', '#', '2021-08-28 11:15:09', '2021-08-28 11:15:10'),
