('cast_21QecUtE07GLbDOyqQWtwpOqNB7Qj7Hyoa', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 1, 'Charlize Theron', 'charlize-theron', '7 Ağustos 1975’de Güney Afrika’nın Benoni adlı şehrinde dünyaya geldi. Theron 15 yaşında iken annesi bir tartışma esnasında babasını vurdu ve babası hayatını kaybetti. Annesi nefs-i müdafaa gerekçesiyle ceza almadı. Bu olaydan sonra aktris, İtalya’ya giderek modellik yapmaya başladı. Milano’da bir ajansla anlaştıktan sonra birçok ünlü magazin dergisine kapak oldu. Theron, 6 yaşında bale dersleri almaya, 16 yaşında ise modellik yapmaya başladı. Bir bankadaki görevliyle hararetli bir tartışma yaşarken oyuncu menajeri John Crosby tarafından keşfedildi. 2 Days in the Valley adlı bir filmle ilk ciddi oyunculuk tecrübesini yaşayan aktris, asıl ününe başrollerini Keanu Reeves ve Al Pacino’nun paylaştığı, 1997 yapımlı “Şeytanın Avukatı ” filmiyle kavuştu.  Cani filmindeki Aileen rolüyle akademi tarafından En İyi Kadın Oyuncu Oscar\'ına layık görülen Theron, oyunculuğunun yanı sıra yardımseverliği ile de tanıyor. Birçok yardım kampanyasında başı çeken isimlerden olan oyuncu aynı zamanda 2012 yılında Jackson adında bir çocuğu evlat edinmişti. 2001 yılından beri İrlandalı aktör Stuart Townsend ile olan birlikteliği 2011 yılının başlarında sona erdi. 2014\'te ise yönetmen ve oyuncu Sean Penn ile beraberliğe başladı fakat ilişki 1,5 yıl sürdü. Daha sonra Prometheus, Hancock, North Country, Young Adult, Pamuk Prenses ve Avcı gibi önemli filmlerde yer aldıktan sonra tekrar büyük bir çıkış yaptığı Oscarlı aksiyon filmi Mad Max: Fury Road\'da başrol karakter Furiosa\'yı canlandırdı.', '6885', 'nm0000234', 'CharlizeAfrica', 'charlizeafrica', 'https://www.themoviedb.org/t/p/w300/1HloWLLhL3iTrmDtMigiitLB9Qx.jpg', 0, 1, 'Benoni, Gauteng, South Africa', '1975-08-07', '#', '2021-08-25 18:23:07', '2021-08-25 18:23:09'),
