('cast_21Qmzio6rSUjHJ62U4YpjVORy6gkQvj24Z', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 1, 'Scarlett Johansson', 'scarlett-johansson', 'Scarlett Johansson, 1984 yılında New York City\'de doğdu. Babası, Karsten Johansson Danimarkalı bir mimar, dedesi Ejner Johansson ise senaryo yazarı ve yönetmendi. Annesi Melanie Sloan ise Polonyalı Aşkenaz bir yapımcıdır. Kardeşi Vanessa Johansson da bir aktristir. Diğer erkek kardeşinin ismi Adrian\'dır. Ve ondan üç dakika sonra doğan Hunter Johansson isminde bir ikiz kardeşi vardır.\n\n27 Eylül 2008 tarihinde \"Two Guys and a Girl\" dizisindeki Berg ve Blade III\'de rol alan Ryan Reynolds ile Kanada\'da aile arasında düzenlenen bir törenle evlendi.Ancak Ryan Reynolds\'ın Sandra Bullock ile görüntülenmesinden sonra boşandılar. 2012 Kasım ayında Fransız gazeteci Romain Dauriac ile birlikteliği başladı. Eylül 2013 tarihinde çift nişanlandıklarını açıklamışlardır. 2014 yılında ilk çocuğuna hamile olan Johansson Fransa\'da yaşamaya başladı. Çiftin Rose adını verdikleri kızları 2014 yılının Eylül ayında dünyaya gelmiştir.', '1245', 'nm0424060', '#', '', 'https://www.themoviedb.org/t/p/w300/6NsMbJXRlDZuDzatN2akFdGuTvx.jpg', 0, 1, 'New York City, New York, USA', '1984-11-22', '#', '2021-08-10 14:51:04', '2021-08-10 14:51:05'),
