('cast_21YvCDurlWu63uOTfTrNuag1btj8XWJ9ec', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 0, 'Baron Yamazaki', 'baron-yamazaki', '', '1845278', '#', '#', '#', '/static/img/defaults/poster_cast.png', 0, 1, '#', '#', '#', '2021-08-28 11:11:20', '2021-08-28 11:11:21'),
('cast_21YwyEJN69hq8gW6Boku2AutN6i4lEB1JB', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 1, 'Emilia Clarke', 'emilia-clarke', 'Emilia Clarke (d. 26 Ekim 1986), İngiliz televizyon ve sinema oyuncusu. Home Box Office kanalında yayınlanan Game of Thrones (Taht Oyunları) dizisindeki \"Daenerys Targaryen\" karakteri ile tanınmaktadır.  İngiltere\'nin Londra şehrinde doğdu ve Berkshire kontunda büyüdü. Babası bir tiyatroda ses mühendisi, annesi iş kadınıdır. Erkek kardeşi ise bir üniversitede siyaset bilimi okumaktadır. Clarke\'ın oyunculuğa ilgisi, daha üç yaşındayken babasının çalıştığı tiyatrodaki Show Boat müzikalini izledikten sonra başladı. İlk olarak Oxford St. Edward Okulu, ardından Rye St.Antony Lisesi\'ni bitirdi. 2009 yılında Drama Centre London Üniversitesi\'nden mezun oldu.\n\nOyunculuğa ilk başladığı yıllarda irili ufaklı birçok projede rol aldı. Televizyondaki ilk rolü ise 2010 yılında Türkiye\'de de gösterime giren Dinozor Saldırısı (Triassic Attack) filmindeki \"Savannah\" karakteriyle olmuştur. Bu filmden sonra Screen International dergisi onu Geleceğin İngiliz Yıldızı (UK Stars Of Tomorrow) olarak değerlendirmiştir.\n\n2010 yılında George R. R. Martin\'in \"A Song of Ice and Fire\" kitabından uyarlanan Game of Thrones (Taht Oyunları) dizisinde Daenerys Targaryen rolüyle karşımıza çıkmıştır. Dizinin oyuncu seçmelerinde Tamzin Merchant\'ın yedeği olarak kalmasına karşın açıklanmayan sebeplerden dolayı bu oyuncunun yerine rol almaya başlamıştır. Aldığı olumlu eleştiriler sayesinde dizinin diğer sezonlarında da bulunmaya hak kazanmıştır. Clarke, Daenerys Targaryen rolüyle EMMY ödüllerinde drama dalında 2011 En İyi Yardımcı Kadın Oyuncu (2011 EMMY Award for Best Supporting Actress) ödülüne layık görülmüştür. En son oynadığı film ise 2016 yapımı olan Me Before You (Senden Önce Ben) filmidir ve Sam Claflin ile başrolü paylaşmıştır. .', '1223786', 'nm3592338', 'emiliaclarke', 'emilia_clarke', 'https://www.themoviedb.org/t/p/w300/86jeYFV40KctQMDQIWhJ5oviNGj.jpg', 0, 1, 'London, England, UK', '1986-10-23', '#', '2021-08-05 13:42:42', '2021-08-05 13:42:43'),
