('content_211J6XHM7yYRUXMsOquTToow2asEhShX9e', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', '언니', '언니', 'eonni', 'Anne ve babalarını kaybettikten sonra In-Ae ve kardeşi Eun Hye kendi başlarına yaşamaya başladılar. Birbilerine sonuna kadar güvenip inanıyorlardır fakat bir Eun Hye ortadan kaybolur. In Ae kardeşini bulmaya çalışır ve kardeşinin kaybolmasına sebep olanlardan intikam almak ister.', '569016', 'tt9535950', 'https://www.themoviedb.org/t/p/w300/resWkxhn67V3EGDXz5UiYr2BuwK.jpg', 'https://www.themoviedb.org/t/p/w500/fhQpVYg35LSKAY0rJBQ1sukAU1W.jpg', 0, 1, 7, 3, '2019-01-01', '2021-08-26 11:29:59', '2021-08-26 11:30:00'),
('content_212Ao8Hn4iWgbAThJtgM0hTKlElfwiCS0w', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Hızlı ve Öfkeli 9', 'F9', 'f9', 'Vin Diesel’in Dom Toretto karakteri, oğlu küçük Brian ile gözlerden uzakta, sessiz bir hayat sürmektedir. Ama huzurlu çevrelerinin hemen ötesinde tehlikenin hep pusuda olduğunu biliyorlardır. Bu kez tehlike Dom’u, en sevdiklerini kurtarmak istiyorsa geçmişinin günahlarıyla yüzleşmeye zorlayacaktır. Dom\'un ekibi, bugüne kadar karşılaştıkları en yetenekli suikastçı ve yüksek performans sürücüsü olan, Dom’un terk edilmiş erkek kardeşi Jakob’un (John Cena) liderliğindeki dünyayı yıkacak bir planı durdurmak için bir araya gelir.', '385128', 'tt5433138', 'https://www.themoviedb.org/t/p/w300/6qcTy5Po5Vn4jnzVqMBv4AmBNWN.jpg', 'https://www.themoviedb.org/t/p/w500/xXHZeb1yhJvnSHPzZDqee0zfMb6.jpg', 0, 1, 8, 0, '2021-05-19', '2021-08-25 18:22:55', '2021-08-25 18:22:56'),
('content_212yGvxXRVE74oAg2jzk43RWKelpAjiJ1B', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Recep İvedik 6', 'Recep İvedik 6', 'recep-ivedik-6', 'Recep İvedik 6, Konya\'ya giderken kendisini Kenya\'da bulan Recep İvedik\'in maceralarını konu ediyor. Recep İvedik\'in hayatı kendisine gelen bir davet ile bambaşka bir hal alır. Davet ile Recep İvedik, kuru fasulye festivaline çağırılmaktadır. Daveti memnuniyetle karşılayan Recep, arkadaşı Nurullah\'ı da yanına alarak Konya\'ya doğru yola koyulur. Daha yolculuğa başlar başlamaz türlü talihsizlikler yaşayan ikili, yolculuğun sonunda kendilerini Konya yerine Kenya\'da bulur. Seyahat acentesinin hatası sonucu Kenya\'ya gelen Recep ve Nurullah, Türkiye\'ye geri dönmenin yolunu arar. Bilmedikleri bir coğrafyada bulunan Recep ile Nurullah, kendilerini birden iki düşman yerli kabilenin arasında bulur. Kendisine has yöntemlerle içinde bulunduğu vahşi dünyada ayakta kalmaya çalışan Recep\'in başına bu süreçte birbirinden ilginç olaylar gelir.', '800240', '#', 'https://www.themoviedb.org/t/p/w300/v19jfsaBjjrHfitnYNDbAshCXZP.jpg', '/static/img/defaults/background_content.png', 0, 1, 0, 15, '', '2021-08-07 13:23:08', '2021-08-07 13:23:09'),
('content_2139IN4E0foZQTUhP4qNATnW8XzhV3DEEf', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'TV', 'Riverdale', 'Riverdale', 'riverdale', 'Küçük bir kasabada yaşayan sürrealist gençlerin hayatını anlatacaktır. Dışarıdan sakin ve şirin bir kasaba gibi gözüken Riverdale’in iç yüzü oldukça karanlık ve tuhaftır. Bu kasabada yaşananlar dışarıdan gelenler için garip olarak adlandırılabilir ancak içeride yaşayanlar için oldukça sıradandır.', '69050', 'tt5420376', 'https://www.themoviedb.org/t/p/w300/6zBWSuYW3Ps1nTfeMS8siS4KUaA.jpg', 'https://www.themoviedb.org/t/p/w500/qZtAf4Z1lazGQoYVXiHOrvLr5lI.jpg', 0, 1, 9, 0, '2017-01-26', '2021-08-25 18:41:34', '2021-08-25 18:41:35'),
('content_214LCVzasmxJqtZhhL4SfClJqcYDjEEMQg', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Zihnin İçinde', 'Into the Mind', 'into-the-mind', '“Dünyayı birçok kişinin zihinleri üzerinden algılarken hayal alemiyle gerçeklik arasındaki çizgiyi bulanıklaştırın. Into The Mind akıl hocalarıyla öğrencilerinin birbirlerine aktardıkları deneyimlere kafa yorarak insanlığın felsefi bir portresini çiziyor. Bizi zorlukların üstesinden gelmeye sevk eden ne?”\r Austin Ross, Rush Sturges, Jimmy Chin, Matty Richard, Kris Erickson, Johnny Collinson, Callum Pettit, JP Auclair, Tom Wallisch, ve Rory Bushfield gibi isimlerin dağlara tırmanmalarını, sonra da gişe rekoru kıran Hollywood filmdekileri aratmayan heyecanlar yaşamalarını izliyoruz...', '163875', 'tt2673812', 'https://www.themoviedb.org/t/p/w300/rnEe2T2UZ6DsWwoLTCfcfTpervU.jpg', 'https://www.themoviedb.org/t/p/w500/jEXwORzEy14ervh2HLnSTfCfPhz.jpg', 0, 1, 7, 3, '2013-09-25', '2021-08-28 23:04:19', '2021-08-28 23:04:25'),
('content_2152X6hjkMObQoxfRsQW6rfuqluAD58kAC', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Para Kamyonu', 'Wrath of Man', 'wrath-of-man', 'Gizemli bir geçmişe sahip olan H, her hafta milyonlarca dolar taşıma işi yapan bir zırhlı araç şirketinde özel güvenlik görevlisi olarak çalışmaya başlar. Olağanüstü yetenekleriyle her soygun girişimini neredeyse tek başına engelleyen H bütün dikkatleri üzerine çeker. Kimsenin hakkında hiçbir şey bilmediği, soyguncuların kabusu haline gelen H, ona en büyük kaybı yaşatan adamlardan intikamını almak için her şeyi göze alır.', '637649', 'tt11083552', 'https://www.themoviedb.org/t/p/w300/M7SUK85sKjaStg4TKhlAVyGlz3.jpg', 'https://www.themoviedb.org/t/p/w500/70AV2Xx5FQYj20labp0EGdbjI6E.jpg', 0, 1, 8, 19, '2021-04-22', '2021-08-02 14:54:35', '2021-08-02 14:54:36'),
('content_215hrjGHWlOfPfcsm7nfmY3h7HSIoq97su', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'TV', 'Stargirl', 'DC\'s Stargirl', 'dc-s-stargirl', 'Zeki, atletik ve her şeyden önce nazik bir kız olan Courtney Whitmore, üvey babasının bir sırrı olduğunu keşfeder: Eskiden bir süper kahramanın yardımcısıydı. Uzun süredir kayıp olan kahramanın kozmik asasını \"ödünç alarak\", tamamen yeni nesil süper kahramanlar için beklenmedik bir ilham kaynağı haline geliyor.', '80986', 'tt8722888', 'https://www.themoviedb.org/t/p/w300/ogntmK9hwBomhajqYrHXUAaqkd7.jpg', 'https://www.themoviedb.org/t/p/w500/pXjpqrx65mlQskf9mfTWSszYODn.jpg', 0, 1, 8, 0, '2020-05-18', '2021-08-25 19:06:28', '2021-08-25 19:06:29'),
('content_215kM0eCltVg0OhpH1qO9lgrTLl0nr0Qx3', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Korku Tüneli', 'XX', 'xx', 'Tamamen kadınlar tarafından senaryosu yazılmış ve yönetilmiş dört kısa metrajın birleştirilmesiyle oluşan bir korku filmidir.', '297160', 'tt3322892', 'https://www.themoviedb.org/t/p/w300/drcIFTEIBnWI4G3OQt6rXOI8hf4.jpg', 'https://www.themoviedb.org/t/p/w500/qbTelIYzMR5DzZqcoHEAnFtBqvL.jpg', 0, 1, 5, 4, '2017-02-17', '2021-08-26 11:34:18', '2021-08-26 11:34:19'),
('content_2166oKJNytIzFDby3pSKURbbRB3PBED3PQ', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'TV', 'Rick ve Morty', 'Rick and Morty', 'rick-and-morty', 'Çılgın bilim insanı Profesör Rick ve torunu Morty’nin boyutlar arası tuhaf ve tehlikeli yolculuklarını konu alan yetişkinlere yönelik çizgi dizi.', '60625', 'tt2861424', 'https://www.themoviedb.org/t/p/w300/8kOWDBK6XlPUzckuHDo3wwVRFwt.jpg', 'https://www.themoviedb.org/t/p/w500/zJZfxi8X3XPHAhxXseRugtnNVtt.jpg', 0, 1, 9, 8, '2013-12-02', '2021-08-25 19:11:10', '2021-08-25 19:11:11'),
('content_217J3UrXPBmCMVpLTvlf3RtYK5SBq7jiP4', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Gerçek Kahraman', 'Free Guy', 'free-guy', 'Guy, sıra dışı yaşamı olan bir banka görevlisidir. Guy, yaşadığı şehir olan Free City\'de kendisinin aslında vahşi bir planın parçası olduğunu keşfeder. Free City açık dünyada geçen bir video oyununda yer alıyordur ve Guy\'ın bu işin içinden sağ kurtulabilmek için olayları çözmesi gerekmektedir. Vizyon tarihi 11.12.2020 olarak değişti.', '550988', 'tt6264654', 'https://www.themoviedb.org/t/p/w300/yHozwx3pQ04MHJbRFRXrGR3XwSX.jpg', 'https://www.themoviedb.org/t/p/w500/j28p5VwI5ieZnNwfeuZ5Ve3mPsn.jpg', 0, 1, 8, 0, '2021-08-11', '2021-08-25 18:22:08', '2021-08-25 18:22:09'),
('content_2186CKnNz9CkMS3tC0tTM9kSnvieWL2lsK', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'TV', 'The Flash', 'The Flash', 'the-flash', 'Geçmişinde büyük bir trajedi yaşamış Barry Allen, Central City Polis Birimi’nde çalışan ve suçluların arkalarında bıraktıkları ipuçlarını toplayan bir adli laboratuvar asistanıdır. Talihsiz bir yıldırım kazası yaşamasının ardından süper hız gücüne sahip olan Barry, Flash kimliğine bürünür ve kötü adamları adalete teslim etmeyi kendine görev edinir!', '60735', 'tt3107288', 'https://www.themoviedb.org/t/p/w300/wHa6KOJAoNTFLFtp7wguUJKSnju.jpg', 'https://www.themoviedb.org/t/p/w500/eyG9srihv68ScRdEbJZj66WT4O0.jpg', 0, 1, 8, 0, '2014-10-07', '2021-08-25 19:16:51', '2021-08-25 19:16:52'),
