('content_21a7SLCdioMbC5kiUVY6dwREFAvMgk5Ysv', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Whistling in Dixie', 'Whistling in Dixie', 'whistling-in-dixie', '', '90461', 'tt0035552', 'https://www.themoviedb.org/t/p/w300/oAzo8y27X0fxxEVRajMTSngzM2f.jpg', 'https://www.themoviedb.org/t/p/w500/oRaB23lB5SNkY1yjxze3zffaQUk.jpg', 0, 1, 0, 2, '1942-12-31', '2021-08-02 15:01:02', '2021-08-02 15:01:03'),
('content_21AfIEE5hglxzbQVzTLChlI8gTzFNYYcUp', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Kara Ada', 'Schwarze Insel', 'schwarze-insel', 'Görünürde huzurlu olan bir adanın karanlık sırları, adaya yeni gelen gizemli bir öğretmenle yakınlaşan yetim bir öğrenciyi pençesine almak üzeredir.', '847981', 'tt12881516', 'https://www.themoviedb.org/t/p/w300/lthWL35rQlNbb9UAv44KEhKNEOX.jpg', 'https://www.themoviedb.org/t/p/w500/uaOiyRpwunmD7PH5y5A5Ag0uutf.jpg', 0, 1, 6, 0, '2021-08-18', '2021-08-28 11:14:37', '2021-08-28 11:14:38'),
('content_21B0R2Ko0JgSdbjoKXFMjZytTdE6GBWlme', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Örümcek Adam 5 : Evden Uzakta', 'Spider-Man: Far From Home', 'spider-man-far-from-home', 'Peter Parker arkadaşları ile birlikte yaz tatili için Avrupa gezisine çıkar. New York\'tan fazlasıyla uzakta olan Peter ve arkadaşlarının başı orada da belaya girer. Bu kez de Peter Parker\'ın arkadaşlarını Quentin Beck, yani namı diğer Mysterio\'nun gazabından koruması gerekmektedir. Yolları Nick Fury ile Avrupa\'da kesişen Peter Parker\'ın başına neler gelecektir?', '429617', 'tt6320628', 'https://www.themoviedb.org/t/p/w300/1vDeiHoNvovVWYkVFM17fliGsfd.jpg', 'https://www.themoviedb.org/t/p/w500/8XiTPU1zfy41Xgg96TCHXj4uQJf.jpg', 0, 1, 8, 20, '2019-06-28', '2021-08-28 11:16:50', '2021-08-28 11:16:51'),
