('content_21Fu6zUsltLYZvqt5EvomCSAFMzg3VsC0e', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Cesur Yürek Gelini Alır', 'दिलवाले दुल्हनिया ले जायेंगे', 'dilvaale-dulhniyaa-le-jaayenge', 'Raj İngiltere\'de yaşayan zengin, sorumsuz ve kaygısız bir Hindistanlıdır. Simran ise İngiltere\'de yaşamasına rağmen Hint geleneklerine sıkı sıkıya bağlı olan bir ailenin kızıdır. İkisi, bir aylık Avrupa gezisi sırasında karşılaşırlar; didişme ve şakalarla başlayan arkadaşlıkları gezinin sonunda aşka dönüşür. Fakat birbirlerine aşık olduklarını anladıklarında artık çok geç olmuştur. Simran babasının Hindistan\'daki arkadaşının oğlu ile evlenmek için yola çıkmıştır bile.', '19404', 'tt0112870', 'https://www.themoviedb.org/t/p/w300/2CAL2433ZeIihfX1Hb2139CX0pW.jpg', 'https://www.themoviedb.org/t/p/w500/gNBCvtYyGPbjPCT1k3MvJuNuXR6.jpg', 0, 1, 9, 0, '1995-10-20', '2021-08-27 21:36:28', '2021-08-27 21:36:29'),
