('content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'TV', 'The Walking Dead', 'The Walking Dead', 'the-walking-dead', 'Zombi kıyametinin ardından hayatta kalanlar, birlikte verdikleri ölüm kalım mücadelesinde insanlığa karşı duydukları umuda tutunur.', '1402', 'tt1520211', 'https://www.themoviedb.org/t/p/w300/rqeYMLryjcawh2JeRpCVUDXYM5b.jpg', 'https://www.themoviedb.org/t/p/w500/wvdWb5kTQipdMDqCclC6Y3zr4j3.jpg', 0, 1, 8, 0, '2010-10-31', '2021-08-25 18:52:58', '2021-08-25 18:52:59'),
