('content_21HWlySI1VPTKEqOM01LzXyGJhci30Bm9A', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Orman Macerası', 'Jungle Cruise', 'jungle-cruise', 'Disneyland\'de yer alan aynı isimli tema parkından sinemaya uyarlanan Jungle Cruise, bir nehir gemisi kaptanı olan Frank ile sonsuz şifa kudretine sahip Hayat Ağacı\'nı aramakta olan bilim insanı Lily\'nin, vahşi yaşamdan doğaüstü varlıklara pek çok zorluklarla karşılaştıkları macerayı anlatıyor.  Lily, Londra’dan Amazon ormanlarına seyahat edecektir ve bunun için Frank’in köhne ama çekici teknesi La Quila’yı kiralamaktan ve Frank’in pek de güvenilir gözükmeyen hizmetlerinden yararlanmaktan başka çaresi yoktur. Genç kadın, tıbbın geleceğini değiştirme potansiyeline sahip, eşsiz iyileştirme özelliği olan kadim ağacı bulmaya kararlıdır. Bu destansı maceraya birlikte atılan beklenmedik ikili, yemyeşil yağmur ormanlarının aldatıcı güzelliğinde gizlenen sayısız tehlike ve doğaüstü güçle karşı karşıya kalacaktır. Ancak kayıp ağacın sırları açığa çıktıkça, Lily ve Frank için riskler daha da yükselecek, hem onların hem de insanlığın kaderi tehlikeye girecektir.', '451048', 'tt0870154', 'https://www.themoviedb.org/t/p/w300/9dKCd55IuTT5QRs989m9Qlb7d2B.jpg', 'https://www.themoviedb.org/t/p/w500/7WJjFviFBffEJvkAms4uWwbcVUk.jpg', 0, 1, 8, 0, '2021-07-28', '2021-08-25 18:20:25', '2021-08-25 18:20:27'),
('content_21I0lT42VHg19umNqPgi9ZDhfBOwHr7655', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', '170 Hz', '170 Hz', '170-hz', '', '109863', 'tt1825636', '/storage/content/content_21I0lT42VHg19umNqPgi9ZDhfBOwHr7655/LORn0ogF8iPSKwIQ21.jpg', '/storage/content/content_21I0lT42VHg19umNqPgi9ZDhfBOwHr7655/bwgfRpOMM0VmOMbF21.jpg', 0, 1, 5, 14, '2012-04-30', '2021-08-12 19:35:21', '2021-08-12 19:35:22'),
('content_21Ib9rzB0qiaoA2hZxKaRFDYUnpWwCgPBF', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Schindler\'in Listesi', 'Schindler\'s List', 'schindler-s-list', 'Gerçek bir hayat hikayesinden uyarlanan film, Oskar Schindler adlı bir Alman işadamının 2. Dünya Savaşı sırasında Polonya\'da kurduğu fabrikada Yahudi işçileri çalıştırmaya başlaması ve bu sayede 1100 Yahudi\'nin hayatını kurtarmasını konu alıyor. Steven Spielberg\'in en önemli yapıtları arasında sayılan ve ünlü yönetmene Oscar kazandıran film, 1994 yılında 12 dalda Oscar\'a aday olmuş ve 7 dalda kazanmıştı. Filmin kazandığı Oscar\'lar : En İyi Film, Yönetim, Kurgu, Sanat Yönetimi, Görüntü, Özgün Müzik ve Senaryo Uyarlaması.', '424', 'tt0108052', 'https://www.themoviedb.org/t/p/w300/sF1U4EUQS8YHUYjNl3pMGNIQyr0.jpg', 'https://www.themoviedb.org/t/p/w500/loRmRzQXZeqG78TqZuyvSlEQfZb.jpg', 0, 1, 9, 0, '1993-11-30', '2021-08-28 11:09:29', '2021-08-28 11:09:30'),
