('content_21iUo1e8ZiVmT5v9VYx79Sm69LeJ1eChq1', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'TV', 'WandaVision', 'WandaVision', 'wandavision', '1950\'li yıllarda geçecek olan WandaVision, beyaz perdede Elizabeth Olsen ve Paul Bettany’nin hayat verdiği Marvel karakterleri Scarlet Witch ve Vision\'a odaklanıyor.', '85271', 'tt9140560', 'https://www.themoviedb.org/t/p/w300/frobUz2X5Pc8OiVZU8Oo5K3NKMM.jpg', 'https://www.themoviedb.org/t/p/w500/1i1N0AVRb54H6ZFPDTwbo9MLxSF.jpg', 0, 1, 8, 8, '2021-01-15', '2021-08-05 14:12:44', '2021-08-05 14:12:45'),
('content_21jS9V5sFiEHX898g5Inhj1kaVQcEJpItC', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'TV', 'Mucize Doktor', 'The Good Doctor', 'the-good-doctor', 'Otistik ve Savant Sendromlu Shaun Murphy (Highmore) isimli genç bir cerrah, prestijli bir hastanenin çocuk cerrahisi birimine yerleştirilir. Şu sorunun cevabı aranır: İnsanlarla iletişim kurma yeteneğine sahip olmayan bir kişi insanların hayatlarını kurtarabilir mi? Yalnız ve çevresindeki kişilerle iletişim kuramayan Shaun, hastalarının hayatlarını kurtarmak ve meslektaşlarının şüphelerini yok etmek için olağanüstü yeteneklerini kullanır.', '71712', 'tt6470478', 'https://www.themoviedb.org/t/p/w300/aMnw2i3qpmqqrxIVNTzrd8zV37g.jpg', 'https://www.themoviedb.org/t/p/w500/iDbIEpCM9nhoayUDTwqFL1iVwzb.jpg', 0, 1, 9, 0, '2017-09-25', '2021-08-25 18:47:27', '2021-08-25 18:47:28'),
