('content_21kQPJgDjVQFpvQk0edYgpy0JhYkZJ5U4e', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'TV', 'El cartel de los sapos: El origen', 'El cartel de los sapos: El origen', 'el-cartel-de-los-sapos-el-origen', '', '128252', 'tt14417802', 'https://www.themoviedb.org/t/p/w300/A17Rt6BLHno0puR1QXbsSKhBfA4.jpg', 'https://www.themoviedb.org/t/p/w500/aGULNElJVpSru19WP2pUjopPX1U.jpg', 0, 1, 8, 0, '2021-07-28', '2021-08-27 21:34:20', '2021-08-27 21:34:21'),
('content_21LgtvyrStp2KMeeEFw1tIWSklDvpWkuUK', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Recep İvedik 5', 'Recep İvedik 5', 'recep-ivedik-5', 'Recep İvedik mahalle sakinlerinden İsmet\'in ailesine taziye ziyaretinde bulunduğu sırada eşinin düştüğü zor duruma üzülerek ona yardım etmek ister. Şoför İsmet\'in son görevini yerine getirmek üzere Nurullah\'ı da yanına alarak yola çıkarlar. Bu yolcuğun kısa süreceğini hayal eden Recep genç sporculardan oluşan Milli Takımı yurt dışındaki bir spor organizasyonuna götürdüğünü fark ettiğinde artık geri dönüşü olmayan bir macera başlamıştır.\r Spor organizasyonuna katılacak ekibin başına gelen talihsiz olay sonucu işler karışırken Recep takımın kontrolünü eline alır. Kazanmaktan başka bir çaresi olmadığına inanan Recep; olayları kendi yöntemleriyle çözmek ister.', '438703', 'tt6439558', 'https://www.themoviedb.org/t/p/w300/5aM49tch3B056NLNgynVkSAxQr.jpg', 'https://www.themoviedb.org/t/p/w500/dj9JxBZXuMrNYvIvHoCIqVWZ5Z3.jpg', 0, 1, 5, 16, '2017-02-16', '2021-08-15 12:42:22', '2021-08-15 12:42:23'),
('content_21lNWosS84exRnWJ7vqVibvo3Lofwdn0nW', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Hızlı ve Öfkeli', 'The Fast and the Furious', 'the-fast-and-the-furious', 'Los Angeles sokaklarında geceleri yasa dışı yarışlara katılan Dominic Toretto, bir dizi soygunun şüphelisidir. Polis teşkilatının başarılı polislerinden Brian O\'Conner da Toretto\'yu yakalamak için onun sokak yarışı çetesine katılır. Ancak zamanla çete üyeleri ile samimi hale gelirken diğer yandan Toretto\'nun kız kardeşine aşık olur. Artık Los Angeles polis memuru Brian O\'Conner sadakatinin kime olduğuna karar vermelidir.', '9799', 'tt0232500', 'https://www.themoviedb.org/t/p/w300/uVeF6zebb3OkjoCK5Wk2AygeEPL.jpg', 'https://www.themoviedb.org/t/p/w500/jY9ef5nqY4xIIMu3yzW3qamUCoi.jpg', 0, 1, 7, 21, '2001-06-22', '2021-08-10 13:55:36', '2021-08-10 13:55:37'),
('content_21LrMXfKHAPjLd0rIoK7it9n5J86MXytfV', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Narco Sub', 'Narco Sub', 'narco-sub', 'Ailesinin kötü adamların elinde esir olduğunu öğrenen adam onları kurtarabilmek için yasa dışı bir yola girmek zorunda bırakılır.', '706972', 'tt10342228', 'https://www.themoviedb.org/t/p/w300/7p0O4mKYLIhU2E5Zcq9Z3vOZ4e9.jpg', 'https://www.themoviedb.org/t/p/w500/r39YwfQiiC5WA9NOPcD90IP57qJ.jpg', 0, 1, 4, 0, '2021-07-22', '2021-08-25 18:21:16', '2021-08-25 18:21:18'),
('content_21ltEP30PO0yzJmcJZoVog0Q7Mqz0IBUsp', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'TV', 'Ölüm Defteri', 'DEATH NOTE', 'death-note', 'Yagami Light, üniversite giriş sınavlarına hazırlanan bir lise son sınıf öğrencisidir. Light (Raito), Japonya\'nın belki de en yetenekli ve zeki öğrencisi olmasına rağmen, yaşadığı dünya ona tat vermemektedir. Her gün gittikçe artan suç oranı ve adalet sisteminin çökmüşlüğü, onun için bu dünyayı daha da anlamsız ve çürümüş kılmaktadır. Bu yüzden de, hiç bir şeyde anlam görmemektedir.\n\nLight, bu buhranlarını kendi içinde yaşarken, ders sırasında bir defterin gökten düştüğünü görür. Okul çıkışı elinde olmadan defterin düştüğü yere yönelir. Defterin üstünde \"Death Note\" yazmaktadır. Defteri yerden alıp incelediğinde hiç de inanacağı şeylerle karşılaşmaz.\n\n\"Bu deftere ismi yazılan insan ölecektir.\"\n\nNedenini kendi bile bilmeden, defteri alıp evine döner. Evde haberleri izlerken, bir adamın bir anaokulundaki öğrencileri ve öğretmenleri rehin aldığını izler. Defterin gerçekliğini test etmek için rehin alan adamın adını deftere yazar. Ve 40 saniye sonra adam ölür.\n\nDefterin gerçekliği karşısında şaşkına dönen Light, kendi ideal dünyasını yaratmak için diğer suçlulara yönelecektir. Ama ya dünya onun varlığını öğrenip peşine dünyanın en iyi dedektifi L\'i takarsa?', '13916', 'tt0877057', 'https://www.themoviedb.org/t/p/w300/vapuYy7yrYcML9bHuq5ct97hpSY.jpg', 'https://www.themoviedb.org/t/p/w500/2Yfzm5857lprGonYPl30XgEpTry.jpg', 0, 1, 9, 11, '2006-10-04', '2021-08-07 10:03:54', '2021-08-07 10:03:55'),
('content_21ltN16J41JSOUPuUlRCXuEKyeNJvV30X4', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Test içerik', 'Test İçerik', 'test-icerik', 'Çok korkunç bir olay meydana gelir!', '', '', '/storage/content/content_21ltN16J41JSOUPuUlRCXuEKyeNJvV30X4/KIyKboZSiwsrepx7xOje75hFXtAXgKoO21.png', '/storage/content/content_21ltN16J41JSOUPuUlRCXuEKyeNJvV30X4/KIyKboZSiwsrepx7xOje75hFXtAXgKoO21.png', 0, 1, 6, 4, '2021-08-30 19:11:25.197669', '2021-08-30 19:11:25', '2021-08-30 19:11:25'),
('content_21m2Kqis2G3Xwu0P6B9bcxNYtgbhtTvFqy', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'El mesero', 'El mesero', 'el-mesero', 'Rodrigo Sada, bir restoranda garson olarak çalışan genç bir adamdır. Her gün lüks ve sofistike hayat süren müşterilere hizmet eden Rodrigo, gördüğü hayata özenir ve müşterileri gibi milyoner olmayı ister. Bu konudaki hırsı, Rodrigo’nun istediğini elde etmesi için görünüşte kolay olan bir yoldan gitmesine neden olur. Ancak bu süreçte karşılaştığı şeyler hiç de düşündüğü gibi olmaz.', '678580', 'tt10886670', 'https://www.themoviedb.org/t/p/w300/zvGC5jX5wQmU1GgPc0VGZz7Mtcs.jpg', 'https://www.themoviedb.org/t/p/w500/qnFxKwYDY7vfc3DBu3m8DzhhCfw.jpg', 0, 1, 8, 2, '2021-07-15', '2021-08-28 11:16:35', '2021-08-28 11:16:36'),
('content_21mfBkLquo35484kie6rQYQq7SxrdSBqUp', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Baba II', 'The Godfather: Part II', 'the-godfather-part-ii', 'Genç Vito Corleone, Amerika\'ya yeni gelmiştir. 1917 yılında, New York şehri\'nin yerel mafyalarından birinin liderini öldürünce saygınlık kazanır ve korkulan biri haline gelir.Bu arada, 50 yıl sonra, Michael Corleone, Washington\'da senato komitesine aile işleriyle ilgili ifade vermektedir.1972 yapımı ilk filmin devamı niteliğinde, yine yazar Mario Puzo ve yönetmen Francis Ford Coppola\'nın yaratıcı ellerinden çıkmış usta işi bir yapım. Eleştirmenler tarafından, önceki filmden daha başarılı bulunan az sayıdaki devam filminden biri olarak kabul ediliyor.', '240', 'tt0071562', 'https://www.themoviedb.org/t/p/w300/hek3koDUyRQk7FIhPXsa6mT2Zc3.jpg', 'https://www.themoviedb.org/t/p/w500/poec6RqOKY9iSiIUmfyfPfiLtvB.jpg', 0, 1, 9, 0, '1974-12-20', '2021-08-28 11:10:35', '2021-08-28 11:10:36'),
('content_21mnnmn787X0vcL4zqNV896BYwxc4RT01R', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Patron Bebek 2: Aile Şirketi', 'The Boss Baby: Family Business', 'the-boss-baby-family-business', 'İlk filmin merkezinde yer alan Tim ve Ted Templaton kardeşlerin birer yetişkin oldukları dönemi anlatan Patron Bebek 2: Aile Şirketi, yetişkin yaşamı sırasında birbirinden uzaklaşan iki kardeşi yeniden bir araya getiren olayları konu ediniyor.', '459151', 'tt6932874', 'https://www.themoviedb.org/t/p/w300/4Paucmgh5iffgcm5IR928TkTHPS.jpg', 'https://www.themoviedb.org/t/p/w500/gX5UrH1TLVVBwI7WxplW43BD6Z1.jpg', 0, 1, 8, 0, '2021-07-01', '2021-08-25 18:24:22', '2021-08-25 18:24:23'),
('content_21QL75rwN2wP75yTqPS9Vx1JJq2PZ3L22O', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'TV', 'Lucifer', 'Lucifer', 'lucifer', '“Cehennem Lordu” Lucifer Morningstar; Los Angeles Polis Departmanı için suçluları yakalamaktadır. Ancak büyük bir sırrı vardır: Bu çekici adam, aslında yeryüzüne düşmüş bir melektir! Neil Gaiman tarafından yaratılan Lucifer, Sandman isimli serinin yardımcı karakterlerinden biriydi ve daha sonra kendi çizgi romanına kavuştu. Çizgi romanlarda, karakter Lux isimli bir barı işletiyor...', '63174', 'tt4052886', 'https://www.themoviedb.org/t/p/w300/cLz75DTxXPPR814YHZ0XhiQuEI2.jpg', 'https://www.themoviedb.org/t/p/w500/ta5oblpMlEcIPIS2YGcq9XEkWK2.jpg', 0, 1, 9, 0, '2016-01-25', '2021-08-25 19:15:44', '2021-08-25 19:15:45'),
('content_21qMnDDPr135qLqouDHYO2DO8FvZLl7zBQ', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Gabriel\'s Inferno Part III', 'Gabriel\'s Inferno Part III', 'gabriel-s-inferno-part-iii', '', '761053', 'tt13535456', 'https://www.themoviedb.org/t/p/w300/fYtHxTxlhzD4QWfEbrC1rypysSD.jpg', 'https://www.themoviedb.org/t/p/w500/fQq1FWp1rC89xDrRMuyFJdFUdMd.jpg', 0, 1, 9, 0, '2020-11-19', '2021-08-28 11:08:54', '2021-08-28 11:09:00'),
('content_21QniFqQ1Ny0HN7sEvBnoD5swWUh4caeAt', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Hızlı ve Öfkeli 3: Tokyo Yarışı', 'The Fast and the Furious: Tokyo Drift', 'the-fast-and-the-furious-tokyo-drift', 'Sean Boswell, kendini ailesine ve çevresine karşı yabancılaşmış hisseden mutsuz bir gençtir. Yasa dışı sokak yarışlarına merakı, bu mutsuzluğunu yenebildiği tek yoldur. Ama bu merak, onu yerel yetkililerle de karşı karşıya getirir. Oğlunun hapse girmesinden korkan annesi, onu Tokyo\'da yaşayan asker babasının yanına gönderir. Tamamen farklı bir kültürde, yabancılık duygusu iyice pekişen Sean\'ın Tokyo\'da ki sıkıcı hayatı, Twinkie ile tanışınca değişmeye başlar. Twinkie sayesinde kendini birden Tokyo\'nun drift yarışları dünyasında bulur. Daha önce alışık olduğu sokak yarışlarından çok daha yüksek tempolu olan bu yarışlarla Sean, artık hiç bilmediği bir dünyanın içine girmek üzeredir.', '9615', 'tt0463985', 'https://www.themoviedb.org/t/p/w300/cxKe1A2GAiRqM1hvsVexVML2guc.jpg', 'https://www.themoviedb.org/t/p/w500/dMARcKLrv0T7kVJ4iQR3vqTTdtT.jpg', 0, 1, 6, 16, '2006-06-03', '2021-08-08 12:45:17', '2021-08-08 12:45:18'),
('content_21qrfK6ropQMoutlNsEsrKGZPuZw4BQICr', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Yarının Savaşı', 'The Tomorrow War', 'the-tomorrow-war', 'İşgal altında bulunan dünyada insanlar, uzaylılara karşı verdikleri savaşta büyük bir yenilgiye uğrar. Artık değişen düzende yaşayan bilim insanları, sistemi değiştirmek için asker yetiştirmeye karar verir. Savaşa hazırlanmak için yeni bir yol keşfeden bilim insanları tarafından yetiştirilen askerlerin vereceği savaş, insanlığın geleceğini belirleyecektir.', '588228', 'tt9777666', 'https://www.themoviedb.org/t/p/w300/34nDCQZwaEvsy4CFO5hkGRFDCVU.jpg', 'https://www.themoviedb.org/t/p/w500/yizL4cEKsVvl17Wc1mGEIrQtM2F.jpg', 0, 1, 8, 0, '2021-06-30', '2021-08-25 18:23:47', '2021-08-25 18:23:48'),
('content_21qSUbYX3WK3ih6vaAVGFvehSM9Gn45HOs', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Baba', 'The Godfather', 'the-godfather', 'Mario Puzo\'nun çok satan kitabından Puzo ve yönetmen Francis Ford Coppola tarafından sinemaya uyarlanan eser, 40\'lar ve 50\'lerin Amerika\'sında, bir İtalyan mafya ailesinin destansı öyküsünü konu alıyor. Corleone ailesi, Don Vito Corleone\'nin başında olduğu, suça dayalı bir örgüt kurmuş olan İtalyan asıllı meşhur bir ailedir. Aile, New York\'taki diğer dört aileyle birlikte New York\'un yeraltı işlerini yönetmektedir. Ancak Corleone ailesini diğerlerinden ayıran özelliği, Don Corleone\'nin cebinde bozuk para gibi taşıdığı politikacılar ve yargıçlardır. Politikacılar ve yargıçlarla olan bu yakın ilişkileri diğer ailelerin açamadığı kapıları açabilmesini sağlamaktadır.', '238', 'tt0068646', 'https://www.themoviedb.org/t/p/w300/obYjrjFT4iZV09YAXu53iBA51Js.jpg', 'https://www.themoviedb.org/t/p/w500/rSPw7tgCH9c6NqICZef4kZjFOQ5.jpg', 0, 1, 9, 0, '1972-03-14', '2021-08-28 11:07:58', '2021-08-28 11:07:59'),
('content_21qUp5tKrSf2yAQXrR5i4AmtJzHyYuMLcR', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'PAW Patrol Filmi', 'PAW Patrol: The Movie', 'paw-patrol-the-movie', 'Paw Patrol dizisinin sinema filmi, şehrin kahraman köpekleri Ryder ve arkadaşlarının, Macera Şehri\'ni kaosa sürükleyen belediye başkanı Humdinger\'a karşı verdikleri mücadeleyi anlatıyor.', '675445', 'tt11832046', 'https://www.themoviedb.org/t/p/w300/vlbFx1gPyTan7l9as168yJmNe9B.jpg', 'https://www.themoviedb.org/t/p/w500/swcF9sPlruc6s4gAHuWfbYicbqG.jpg', 0, 1, 8, 0, '2021-08-09', '2021-08-25 18:22:50', '2021-08-25 18:22:51'),
('content_21qVm8pSOrR5iUCbIPMp0OVJQQ9FwKBaIP', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Arınma Gecesi: Sonsuza Dek', 'The Forever Purge', 'the-forever-purge', '12 saat boyunca tüm suçların serbest olmasıyla birlikte yaşanan olayları konu edinen Arınma Gecesi filminin 5. devam halkası olan yapımın oyuncu kadrosunda Ana de la Reguera, Gregory Zaragoza, Tenoch Huerta, Emily Trujillo gibi isimler yer alıyor. Yönetmen koltuğunda Everardo Gout\'un oturduğu filmin senaryosunu James DeMonaco kaleme alıyor.', '602223', 'tt10327252', 'https://www.themoviedb.org/t/p/w300/kSJVYGXkeTaHV03d9OFFCLtMPTe.jpg', 'https://www.themoviedb.org/t/p/w500/tehpKMsls621GT9WUQie2Ft6LmP.jpg', 0, 1, 8, 2, '2021-06-30', '2021-08-25 18:26:14', '2021-08-25 18:26:15'),
('content_21r6k4N56FBDyuSNxnoLRSk9GguPCubUPy', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'TV', 'Celebrity Big Brother\'s Bit on the Side', 'Celebrity Big Brother\'s Bit on the Side', 'celebrity-big-brother-s-bit-on-the-side', '', '73106', '#', 'https://www.themoviedb.org/t/p/w300/4zr7J1UrdqiDyhNU2JHiqozUOLQ.jpg', '/static/img/defaults/background_content.png', 0, 1, 3, 0, '2011-08-18', '2021-08-25 19:08:20', '2021-08-25 19:08:21'),
('content_21RbP7BjUgf6JS2XPxwIF1b9M8bcFiJY77', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Tatlı Kız', 'Sweet Girl', 'sweet-girl', 'Hayatının aşkını bir ilaç şirketinin açgözlülüğü yüzünden kaybeden ve bu dünyada kızından başka kimsesi kalmayan bir adam, adaletin yerine gelmesini sağlayabilecek mi?', '619297', 'tt10731768', 'https://www.themoviedb.org/t/p/w300/tshCVHOq1S99mxaV5IzR0oOco9P.jpg', 'https://www.themoviedb.org/t/p/w500/nprqOIEfiMMQx16lgKeLf3rmPrR.jpg', 0, 1, 7, 3, '2021-08-18', '2021-08-28 11:13:51', '2021-08-28 11:13:52'),
('content_21RTah73n744t3NPZmHug5gqGzCYlT7tME', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Cruella', 'Cruella', 'cruella', '1970’li yıllarda Londra’sında asi ve kendine has genç bir kadın olan Estella, zeki olduğu kadar yaratıcıdır ve en büyük hayali kendi adına bir moda markası yaratmaktır. Talihsizlikler sonucu Londra’da beş parasız, yetim ve yalnız kalan Estella, Jasper ve Horace adında iki hırsız ile arkadaş olur. Bir şeyler aşırarak hayatlarını sürdürürler ancak Estella katiyen moda tutkusundan vazgeçmez. Estella’nın bu tutkusu ve tarzı sayesinde yolu ünlü bir moda tasarımcısı olan narsisist Baroness von Hellman ile kesişir. Baroness’in yanında çalışmaya başlayan Estella, bir gün kendisi ile ilgili korkunç bir sırrı keşfetmesi ile birlikte intikam ateşiyle dolu Cruella de Vil’ı ortaya çıkarır.', '337404', 'tt3228774', 'https://www.themoviedb.org/t/p/w300/wToO8opxkGwKgSfJ1JK8tGvkG6U.jpg', 'https://www.themoviedb.org/t/p/w500/6MKr3KgOLmzOP6MSuZERO41Lpkt.jpg', 0, 1, 8, 0, '2021-05-26', '2021-08-28 11:15:07', '2021-08-28 11:15:08'),
('content_21sk5M8bs9NGstUB50VD32wml7aGbzkIxE', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Amor.com', 'Amor.com', 'amor-com', '', '448763', 'tt5635808', 'https://www.themoviedb.org/t/p/w300/d0af8u9n0BEW999ZQVEDDCHCRVV.jpg', 'https://www.themoviedb.org/t/p/w500/cxxVTy1SxzUM4aE2ig9WFW99EBR.jpg', 0, 1, 7, 6, '2017-06-01', '2021-08-12 22:14:59', '2021-08-12 22:15:02'),
('content_21SO8qVA5Yo8k4YlWAATZPgYrsKY7ei7Ql', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Luka', 'Luca', 'luca', 'Film, İtalyan Riviera’sında yaşayan Luca adlı küçük bir çocuğun hikâyesini anlatıyor. Luca’nın yaz aylarındaki macerasını anlatan film, bizi karanlık bir sırla baş başa bırakıyor. O da Luca’nın deniz yüzeyinin altındaki dünyadan gelen bir deniz canavarı olması.', '508943', 'tt12801262', 'https://www.themoviedb.org/t/p/w300/p33BoxA0zwuD43ohsiCNAGNWj9K.jpg', 'https://www.themoviedb.org/t/p/w500/620hnMVLu6RSZW6a5rwO8gqpt0t.jpg', 0, 1, 8, 0, '2021-06-17', '2021-08-25 18:25:34', '2021-08-25 18:25:40'),
('content_21SxAI5TTxYQeI6b0crF9xwc8BxGIxk13o', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Esaretin Bedeli', 'The Shawshank Redemption', 'the-shawshank-redemption', 'Genç ve başarılı bir banker olan Andy Dufresne, karısını ve onun sevgilisini öldürmek suçundan ömür boyu hapse mahkum edilir ve Shawshank hapishanesine gönderilir. İşkence, tecavüz, dayak dahil her türlü kötü koşulun hüküm sürdüğü hapishane koşullarında, Andy\'nin hayata bağlı ve her daim iyi bir şeyler bulma çabası içindeki hali, çevresindeki herkesi çok etkileyecektir. Bir süre sonra parmaklıkların arkasında bile özgür bir yaşam olabileceğine bütün mahkumları inandırır. Bu mahkumlardan biri olan Ellis Boyd \"Red\" ve Andy, unutulmaz bir dostluk kurarak hapishaneyi bambaşka bir yer haline getirirler.', '278', 'tt0111161', 'https://www.themoviedb.org/t/p/w300/eOZrLKszfq8VOqPUxOVlSLwpY5W.jpg', 'https://www.themoviedb.org/t/p/w500/9Xw0I5RV2ZqNLpul6lXKoviYg55.jpg', 0, 1, 9, 0, '1994-09-23', '2021-08-27 21:38:06', '2021-08-27 21:38:14'),
('content_21SygE4ujbSwYvMFTFc0UztZoxJljjg1jT', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Recep İvedik', 'Recep İvedik', 'recep-ivedik', 'Adamın biri yolda cüzdanını düşürür, sokaklarda yaşayan başka bir adam tam cüzdanı kapıp kaçacakken Recep İvedik onunla mücadeleye girer. Sonunda, sahibine teslim etmek üzere, evsiz adamın elinden cüzdanı almayı başaran Recep İvedik kafasını çevirdiği anda cüzdan sahibinin çoktan gittiğini farkeder. Akşam evinde televizyon seyreden Recep İvedik, cüzdanın Antalyalı çok önemli bir iş adamına ait olduğunu öğrenince arabasına atlar ve güneye doğru yola koyulur. Yol boyunca birbirinden komik sürprizlerle karşılaşan Recep İvedik en sonunda Antalya’ya varmayı başarır ve cüzdanı turizmci Muhsin Bey’e teslim eder. İş adamının ısrarlarına rağmen Recep İvedik ne para almayı kabul eder ne de otelde kalmayı... Fakat tam otelden ayrılacakken çocukluk aşkı Sibel’in bir tur otobüsünden indiğini farkeder. Artık Recep İvedik’in tek bir amacı vardır; kendisini tanımayan, hatta hatırlamayan Sibel’e kendini beğendirmek.Recep İvedik’in asıl keyifli tatil macerası bundan sonra başlayacaktır.', '31060', 'tt1193516', 'https://www.themoviedb.org/t/p/w300/4Ag2wjMtkhrPdHQHCT6YN2EHUvd.jpg', 'https://www.themoviedb.org/t/p/w500/mtzMqnw2EETtp81Vx91Qgde3dsF.jpg', 0, 1, 5, 8, '2008-02-22', '2021-08-05 13:41:01', '2021-08-05 13:41:02'),
('content_21t9a9wdjwaxm2mR4swTlC7LNTfPrMe6xX', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Jolt', 'Jolt', 'jolt', 'Öfke kontrolünü sağlamakta sorunlar yaşayan ve cinayet işlemek isteyen bir yapıya sahip olan bir kadın, bu sorununu elektrot kaplı bir yelek giyerek kontrol altına almaya çalışır. Genç kadın, elektrotlu yelek sayesinde yaşamına normal bir şekilde devam edebilmektedir. Ancak aşık olduğu ilk adamın öldürülmesi, genç kadının öfkesini bastıran yeleği çıkarmasına neden olur. Sevdiği adamın katil ya da katillerini bulmak için her şeyi göze alan kadının öfke problemi, onun cinayetin baş şüphelisi haline gelmesine neden olur.', '617502', 'tt10228134', 'https://www.themoviedb.org/t/p/w300/gYZAHan5CHPFXORpQMvOjCTug4E.jpg', 'https://www.themoviedb.org/t/p/w500/wPjtacig0kIkVcTQmXoNt6jbMwo.jpg', 0, 1, 7, 2, '2021-07-15', '2021-08-25 18:26:50', '2021-08-25 18:26:51'),
('content_21TjbNxLqgS7Px3I4OOoiOc3GTojyR0sUL', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Gabriel\'s Inferno', 'Gabriel\'s Inferno', 'gabriel-s-inferno', 'Baştan çıkarma, yasak aşk ve kurtuluşun ilgi çekici ve günahkâr bir keşfi olan Gabriel\'s Inferno, bir adamın imkansızlığını - affetmeyi ve sevgiyi kazanmaya çalışırken kendi kişisel cehenneminden kaçışının büyüleyici ve çılgınca tutkulu bir hikayesidir.', '696374', 'tt11316854', 'https://www.themoviedb.org/t/p/w300/oyG9TL7FcRP4EZ9Vid6uKzwdndz.jpg', 'https://www.themoviedb.org/t/p/w500/w2uGvCpMtvRqZg6waC1hvLyZoJa.jpg', 0, 1, 9, 2, '2020-05-29', '2021-08-28 11:09:13', '2021-08-28 11:09:19'),
('content_21tZsaOOtPJl6gld15QXuak8SnNq7VQv4X', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Emekli Ajan', 'Le Dernier Mercenaire', 'le-dernier-mercenaire', 'Paralı askerlik yapan eski bir gizli servis ajanı hiç tanışmadığı oğlunu kurtarmak için kolları sıvar. Ne var ki baba olmayı öğrenmek bugüne kadarki en zorlu görevidir.', '729720', 'tt12808182', 'https://www.themoviedb.org/t/p/w300/sNfEiOU2QOACkdcUBKRzhFcIYTN.jpg', 'https://www.themoviedb.org/t/p/w500/rUoGZuscSG4fQP3I56ndadu2A8E.jpg', 0, 1, 7, 0, '2021-07-30', '2021-08-25 18:25:12', '2021-08-25 18:25:13'),
('content_21V0XqlCQpzt2IUudzlIkYtsC5BZQ762MD', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'TV', 'What If...?', 'What If...?', 'what-if', 'Marvel Sinematik Evrenindeki önemli anlar, hikayeler tamamen farklı olsaydı ve başka bir gerçeklikte olsaydı kahramanların neler yaşayabileceğini gözler önüne seriyor.', '91363', 'tt10168312', 'https://www.themoviedb.org/t/p/w300/lztz5XBMG1x6Y5ubz7CxfPFsAcW.jpg', 'https://www.themoviedb.org/t/p/w500/4N6zEMfZ57zNEQcM8gWeERFupMv.jpg', 0, 1, 9, 0, '2021-08-11', '2021-08-25 18:37:58', '2021-08-25 18:38:04'),
('content_21v4laQtHPTc3kg8NZOj1qMCJ7CWQZog9w', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'The Suicide Squad: İntihar Timi', 'The Suicide Squad', 'the-suicide-squad', 'Bloodsport, Peacemaker, Kaptan Boomerang, Ratcatcher 2, Savant, King Shark, Blackguard, Javelin ve herkesin en sevdiği psikopat Harley Quinn dahil olmak üzere bir mahkum koleksiyonu oluşturun. Sonra onları ağır bir şekilde silahlandırın ve (kelimenin tam anlamıyla) uzaktaki, düşmanla beslenen Corto Maltese adasına bırakın. Her fırsatta militan düşmanlar ve gerilla güçleri ile dolu bir ormanda yürüyüş yapan Squad, yerde sadece Albay Rick Flag ile onları harekete geçirecek bir ara-yok et görevinde ... ve her zaman olduğu gibi Amanda Waller\'ın hükümet teknisyenlerinin kulaklarında her hareket, bir yanlış hamle ve ölürler (rakiplerinin, bir takım arkadaşının veya Waller\'ın kendi elinde). Biri bahis koyuyorsa, akıllı para onların aleyhine olur – hepsinin aleyhine.', '436969', 'tt6334354', 'https://www.themoviedb.org/t/p/w300/65HH8CsLmesa8yAv4kB4HTvYK74.jpg', 'https://www.themoviedb.org/t/p/w500/jlGmlFOcfo8n5tURmhC7YVd4Iyy.jpg', 0, 1, 8, 0, '2021-07-28', '2021-08-25 18:19:47', '2021-08-25 18:19:48'),
('content_21VG8cpteSIuD8W7HCHxtAUTBIUHr1NC0O', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Gabriel\'s Inferno Part II', 'Gabriel\'s Inferno Part II', 'gabriel-s-inferno-part-ii', 'Profesör Gabriel Emerson nihayet Julia Mitchell\'in kimliği hakkındaki gerçeği öğrenir, ancak gerçekleşmesi çok geç gelir. Julia, saygın Dante uzmanının onu hatırlamasını bekliyor ve onunla daha fazla bir şey yapmak istemiyor. Gabriel başkasının kollarında sevgi bulmadan kalbini geri kazanabilir mi?', '724089', 'tt13535454', 'https://www.themoviedb.org/t/p/w300/pci1ArYW7oJ2eyTo2NMYEKHHiCP.jpg', 'https://www.themoviedb.org/t/p/w500/jtAI6OJIWLWiRItNSZoWjrsUtmi.jpg', 0, 1, 9, 0, '2020-07-31', '2021-08-28 11:07:40', '2021-08-28 11:07:41');
INSERT INTO `content` (`idContent`, `idAddProfile`, `idAddAccount`, `type`, `title`, `titleOriginal`, `titleUrl`, `overview`, `idTmdb`, `idImdb`, `imagePoster`, `imageBackground`, `adult`, `visibility`, `voteAverage`, `visitCount`, `releaseDate`, `lastEditDate`, `addDate`) VALUES
('content_21vIv1plKTHolYa3c0ZDKZmemY7exvsrSV', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Kara Dul', 'Black Widow', 'black-widow', 'Black Widow\'un gizemli geçmişine ve KGB ile olan ilişkilerine ışık tutacak. Merakla beklenen filmde Black Widow\'un Kırmızı Oda\'dan başka casuslarla karşılaşmasını ve Marvel Comics\'in en sevilen kötü adamlarından biri olan Taskmaster ile savaşmasını göreceğiz. Ayrıca Red Guardian ile Black Widow\'un ilişkisine de ışık tutulacak. Red Guardian çizgi romanlarda, Rusya\'nın Captain America\'sı olarak tanınıyor. Ayrıca Captain America ve Black Widow\'u kurtarırken kendini feda ettiği de bilinenler arasında yer alıyor.', '497698', 'tt3480822', 'https://www.themoviedb.org/t/p/w300/aTHDFcHJ9boSzGlqNJY3DHGwj9X.jpg', 'https://www.themoviedb.org/t/p/w500/dq18nCTTLpy9PmtzZI6Y2yAgdw5.jpg', 0, 1, 8, 13, '2021-07-07', '2021-08-10 14:51:01', '2021-08-10 14:51:02'),
('content_21vkEsXLMnP8D7wyzYy6seTQEEflCkHKXa', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Space Jam: Yeni Efsane', 'Space Jam: A New Legacy', 'space-jam-a-new-legacy', 'Yoldan çıkmış bir yapay zeka tarafından küçük oğlu Dom’la birlikte dijital bir alana hapsedilen LeBron’ın kendilerini sağsalim eve götürebilmek için yapması gereken, Bugs, Lola Bunny ve disiplinsizlikleriyle ünlü bütün Looney Tunes çetesine önderlik ederek, sahada yapay zekanın dijitalleştirilmiş şampiyonlarına --daha önce hiç görmediğiniz profesyonel basketbol yıldızlarından oluşan süper güçlü bir kadroya-- karşı onları zafere taşımaktır. Oğluyla bağını yeniden tanımlayacak ve kendimiz olmanın gücüne ışık tutacak olan, LeBron’ın hayatının bu en önemli mücadelesinde Tunes\'a karşı Goons. Aksiyona hazır Tunes’lar gelenekleri ezip geçiyor, benzersiz yeteneklerini süper şarjlıyorlar ve oyunu kendi yöntemleriyle oynayarak \"Kral\" James\'i bile şaşırtıyorlar.', '379686', 'tt3554046', 'https://www.themoviedb.org/t/p/w300/e7tu3drDp8mU2otQkeOkeMZTjkc.jpg', 'https://www.themoviedb.org/t/p/w500/8s4h9friP6Ci3adRGahHARVd76E.jpg', 0, 1, 8, 7, '2021-07-08', '2021-08-12 21:56:15', '2021-08-12 21:56:17'),
('content_21VripXgBhDdW9cHytgRlfD4j3fDNBctND', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'TV', 'Your Honor 2222', 'Your Honor2525', 'your-honor25252', 'Bryan Cranston, Your Honor dizisinde bir vur kaç olayına karışan oğlunu kurtarmak için suça bulaşan, mesleği ve babalık değerleri arasında ikilime düşen bir hâkime hayat veriyor. Yıllar boyu adaleti sağlamak için çalışan bu hâkim, oğlunun kötü olaylara dâhil olması sonucunda kendisini ve kariyerini tehlikeli bir durumun içerisine sürüklüyor.2222', '86430xxxx', 'tt7440726xxxxx', '/storage/content/content_21VripXgBhDdW9cHytgRlfD4j3fDNBctND/JS4Uyx8tfDvlVXuh21.jpg', '/storage/content/content_21VripXgBhDdW9cHytgRlfD4j3fDNBctND/naGIcxwBcmyfy1GTj3UJ11W4eRvLJDlh21.jpg', 0, 1, 8, 26, '2020-12-06', '2021-08-15 13:58:44', '2021-08-15 13:58:45'),
('content_21wBsHcz8kZF8QuGVDXTdZRVtkKrKvmYmB', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Parazit', '기생충', 'parasite', 'Film, birbirinden yapı olarak tamamen farklı iki aileyi konu ediniyor. Ki-taek ve ailesi komple işsizdir ve varoşlarda yaşamaktadırlar. Ki-taek’in oğlu Ki-woo, bir arkadaşının referansı ile çok zengin, bir o kadar da saf olan Park ailesinin kızına İngilizce için özel ders vermeye başlar. Ancak bu onlara yeterli gelmez ve maaile Park ailesinin evdeki çalışanlarının adım adım kuyusunu kazarak çeşitli üçkağıtçılıklarla kapağı Park ailesine atmayı başarırlar. Ancak fazla açgözlülükleri ve beleşçilikleri günün birinde başlarına bela olacaktır.', '496243', 'tt6751668', 'https://www.themoviedb.org/t/p/w300/yh5rAnhNiZz0nkWhbWw98MvdvBH.jpg', 'https://www.themoviedb.org/t/p/w500/TU9NIjwzjoKPwQHoHshkFcQUCG.jpg', 0, 1, 9, 21, '2019-05-30', '2021-08-10 11:33:20', '2021-08-10 11:33:20'),
('content_21YBGIijGX80QZuHVUfcyfa6eJh4EI6OHP', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Un Rescate de Huevitos', 'Un Rescate de Huevitos', 'un-rescate-de-huevitos', '', '573164', 'tt8049994', 'https://www.themoviedb.org/t/p/w300/lq68Z5htr1bjPd8X0U3PBZRcUij.jpg', 'https://www.themoviedb.org/t/p/w500/5CfndBOq4T6mN6n87lcb86cfVeo.jpg', 0, 1, 8, 0, '2021-08-12', '2021-08-25 18:21:37', '2021-08-25 18:21:38'),
('content_21yiNJQ6Qy01hcAXg38CQj4ViCsGvR7isC', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Yıldızlara Doğru', 'Ad Astra', 'ad-astra', 'Askeri mühendis olan Roy McBride\'ın babası Clifford, 20 yıl önce uzayda insan dışı bir varlığın emaresini aramak için çıktığı görevde kaybolmuştur. Roy, babasının hala hayatta olduğuna dair bir kanıt elde eder ve bu kanıtın sırf Roy’un babası için değil, tüm kainat için tehlikeli olabileceğini görür. Bunun üzerine Roy, babasını bulmak için galakside tek yönlü bir yolculuğa çıkar.', '419704', 'tt2935510', 'https://www.themoviedb.org/t/p/w300/l3JgqdqILmpSq5VFZA69mP6bmME.jpg', 'https://www.themoviedb.org/t/p/w500/AeDS2MKGFy6QcjgWbJBde0Ga6Hd.jpg', 0, 1, 6, 0, '2019-09-17', '2021-08-28 23:01:47', '2021-08-28 23:01:48'),
('content_21YtlHwoKCxUeFZDGyqvUul53gqUOyYpCI', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'TV', 'Loki', 'Loki', 'loki', 'Avengers: Endgame  olayları sırasında Tesseract\'ı çaldıktan sonra, Loki\'nin alternatif bir versiyonu, zaman ve mekanın dışında var olan ve zaman çizgisini izleyen bürokratik bir organizasyon olan gizemli Zaman Varyantları Otoritesi\'ne getirilir. Zaman varyantı olması nedeniyle varlığının silinmesi veya zaman çizgisinin düzeltilmesine ve daha büyük bir tehdidin durdurulmasına yardımcı olmak için Loki\'ye bir seçenek sunarlar.', '84958', 'tt9140554', 'https://www.themoviedb.org/t/p/w300/kEl2t3OhXc3Zb9FBh1AuYzRTgZp.jpg', 'https://www.themoviedb.org/t/p/w500/bZGAX8oMDm3Mo5i0ZPKh9G2OcaO.jpg', 0, 1, 8, 22, '2021-06-09', '2021-07-24 21:42:01', '2021-07-24 21:42:02'),
('content_21yVUCxyL8cqTq1LxSnImG2CgXxoHTv4xt', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'TV', 'अनुपमा', 'अनुपमा', 'anupmaa', '', '116479', 'tt11867666', 'https://www.themoviedb.org/t/p/w300/9R4Qtm01pNh0CzdoIyvHKefe5RL.jpg', 'https://www.themoviedb.org/t/p/w500/2748H9LoK2oQd9L7ofze8VjCGhS.jpg', 0, 1, 10, 3, '2020-07-13', '2021-07-24 21:40:05', '2021-07-24 21:40:06'),
('content_21ZcYKj90wDfDoYRUaoEFiOc7ry0xMDfcg', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Medusa', 'Medusa', 'medusa', '', '820710', 'tt13846494', 'https://www.themoviedb.org/t/p/w300/7tcxxE97FOpGMHLvG77uk2lF1pm.jpg', 'https://www.themoviedb.org/t/p/w500/sHpGISR8ogFlimSVziUCVxo3o2j.jpg', 0, 1, 0, 5, '2022-03-16', '2021-08-02 14:16:28', '2021-08-02 14:16:29'),
('content_21ZICBH4099WlP14P5OURvUIMELzU9KDjI', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Infinite', 'Infinite', 'infinite', 'Evan Michaels, çok gerçekçi rüyalardan müzdarip bir adamdır. Geçmişteki iki yaşantısından anılarını rüyalarında gören Evan, günün birinde Cognomina isimli gizli bir örgütü keşfeder. Cognomina örgütü yüzyıllardır varlığını sürdüren çok gizli bir örgüttür ve yıllar boyunca reenkarne olarak dünyaya gelen kadın ve erkeklerden oluşmaktadır. Bu örgütün üyeleri zamanın değişimleri konusunda ajan olarak çalışmaktadır. Fakat çok güçlü bir düşman zamanın hassas dengelerini tehdit etmektedir. Dünyanın kaderini değiştirecek isim ise sayılamayacak kadar fazla hayat yaşayan ancak bunların birer rüya olduğunu zannettiği için şizofrenik hale gelen bir adam olacaktır...', '581726', 'tt6654210', 'https://www.themoviedb.org/t/p/w300/niw2AKHz6XmwiRMLWaoyAOAti0G.jpg', 'https://www.themoviedb.org/t/p/w500/wjQXZTlFM3PVEUmKf1sUajjygqT.jpg', 0, 1, 7, 0, '2021-06-10', '2021-08-25 18:23:19', '2021-08-25 18:23:20'),
('content_21zp62E91xJDvHlySnD5xsG2OcrszBXqM4', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Beckett', 'Beckett', 'beckett', 'Yunanistan\'da geçirdiği trajik bir kaza sonrası kendini siyasi bir komplonun ortasında bulan Amerikalı bir turist, onu öldürmeye kararlı olan suikastçılardan kaçar.', '597433', 'tt10230994', 'https://www.themoviedb.org/t/p/w300/fBJducGBcmrcIOQdhm4BUBNDiMu.jpg', 'https://www.themoviedb.org/t/p/w500/lzLzKXq2C0kL5Pu7VW5sNl5KV6L.jpg', 0, 1, 6, 2, '2021-08-04', '2021-08-25 18:28:19', '2021-08-25 18:28:20'),
('content_21zQxtgjKI2ILSK2RAuj6SQLTdFdj67O2i', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'MOVIE', 'Senin Adın', '君の名は。', 'jun-noming-ha', 'Mitsuha Miyamizu, kırsal kesimde, dağların etrafını sardığı bir kentte yaşamaktadır. Vali olan babası genellikte evde bulunmadığından evinde daha çok ilkokul öğrencisi kız kardeşi ve büyük annesiyle kalan Mitsuha her ne kadar dürüst bir kişiliğe sahip olsa da ailesinin Shinto tapınağına ait geleneklerden ve babasının seçim kampanyasında yer almasından hiç hoşlanmamaktadır. Kırsal kesimde yaşadığı için içten içe üzülmekte ve Tokyo’daki harikulade şehir hayatını arzulamaktadır. Taki Tachibana ise Tokyo’nun merkezinde yaşayan liseli bir gençtir. Arkadaşlarıyla zaman geçirmekten hoşlanan ve bir İtalyan restoranında yarı zamanlı çalışan Taki, mimariye ve güzel sanatlara ilgi duymaktadır. Günlerden bir gün rüyasında daha önce hiç gitmediği dağlar arasına kurulmuş bir şehirde yaşayan genç bir kız olduğunu görür. Mitsuha ise erkek olduğu bir rüya görecektir. Rüyalarının arkasındaki sır nedir?', '372058', 'tt5311514', 'https://www.themoviedb.org/t/p/w300/wNW0wtDePb7hkVHWCYErwRWwbiJ.jpg', 'https://www.themoviedb.org/t/p/w500/dIWwZW7dJJtqC6CgWzYkNVKIUm8.jpg', 0, 1, 9, 0, '2016-08-26', '2021-08-28 11:10:42', '2021-08-28 11:10:43');
