('tv_episode_content_216kJtUA89XZmsWn2uR0amtB1I6lBx0wQV', 'tv_season_content_21QTUUY2XVSWIPEGhWRKdt5gB48PIf9VL4', 'content_21ltEP30PO0yzJmcJZoVog0Q7Mqz0IBUsp', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Adalet', 'Kira tarafından öldürülmeyeceğinden emin olmak isteyen Mello, kendi fotoğrafını ele geçirmek üzere SPK merkezine dalar.', '13916', 'tt1021404', 'https://www.themoviedb.org/t/p/w500/hhNecHn6UEcvGIXaWaSqKfGOBIM.jpg', 1, 30, 1, 8, 2, '2007-05-09', '2021-08-07 10:05:33', '2021-08-07 10:05:34'),
