('tv_episode_content_216mPIa7W3w4Mc34FQZmdbB11fQKGWWsEK', 'tv_season_content_21nCkezpbNb7rVCnm0qumkXLpnPyfI6P31', 'content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Adamın Teki', 'Yıkıcı bir saldırının ardından hayatta kalanlar, yaşam savaşı verir. Bir Kurtarıcı karakolunda tek başına olan Carol, hızlı düşünüp hareket etmelidir.', '1402', 'tt6198662', 'https://www.themoviedb.org/t/p/w500/bFcs8JqW6Xc7k6RXjk5Tw69gqi2.jpg', 8, 4, 1, 7, 0, '2017-11-12', '2021-08-25 19:03:00', '2021-08-25 19:03:02'),
