('tv_episode_content_216UK2O6UzFIv8jgP8axfcOrdPfIW4qTHf', 'tv_season_content_21rfPHIFv6itHahJR4v48AVlRe9MdBW1Ec', 'content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Stradivarius', 'Rosita hayatta kalmak için kaçarken Michonne yeni gelenleri Hilltop\'a götürür. İsa ve Aaron yakınlaşır. Daryl kürkçü dükkânına geri döner.', '1402', 'tt8250820', 'https://www.themoviedb.org/t/p/w500/vNWpL0E9Qk15BVv7VlOh41m6dxa.jpg', 9, 7, 1, 7, 0, '2018-11-18', '2021-08-25 19:04:07', '2021-08-25 19:04:09'),
