('tv_episode_content_21FKrwgEwhA5Lg5K1Z6oVywYzZSGr4i09i', 'tv_season_content_21nCkezpbNb7rVCnm0qumkXLpnPyfI6P31', 'content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Merhamet', 'Rick, Ezekiel ve Maggie özenle hazırlanmış bir planla Sığınak\'a saldırmaya karar verir. Carl, petrol istasyonunda gizemli bir yabancıyla karşılaşır.', '1402', 'tt6156390', 'https://www.themoviedb.org/t/p/w500/kwjDWLxYxCB54ql03lTGttln8Sm.jpg', 8, 1, 1, 7, 0, '2017-10-22', '2021-08-25 19:02:51', '2021-08-25 19:02:52'),
('tv_episode_content_21fLoxvntqWpdpCOXdbS2MX27tufan7ICO', 'tv_season_content_21qSlMPpCrDiaSse5DhStgL8Vqq9PatkXq', 'content_21GXYZN2vlp5qB9dDc4wgLAjYUGVs3cVrK', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Kadim Kehanetler', 'Ölüm, şiddet ve moral bozukluğu sarmalının ortasında II. Mehmet Giustiniani\'ye cazip bir teklif sunar. Sadrazam, II. Mehmet\'e düşmanıyla ateşkes yapmasını tavsiye eder.', '96481', '#', 'https://www.themoviedb.org/t/p/w500/kg31mt4y2kEkvOaSGFL7Y7C861A.jpg', 1, 5, 1, 0, 0, '2020-01-24', '2021-08-05 14:15:57', '2021-08-05 14:15:58'),
('tv_episode_content_21flRIY7NAwb0kL63OVLe4IWaQKhohO0sp', 'tv_season_content_21qT50mPxsWJtWjPqiRjfaPZG9r67NrDis', 'content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Düşmanlar ve Musibetler', 'Negan\'ın en yeni esiri, Sığınak\'taki güzel hayatın tadına bakar ve zekâsı için ödüllendirilir. Dwight, zor durumdadır.', '1402', 'tt5207754', 'https://www.themoviedb.org/t/p/w500/1dl6OLmrx6VRhIM5Dogozc2IjeA.jpg', 7, 11, 1, 7, 0, '2017-02-26', '2021-08-25 19:02:29', '2021-08-25 19:02:30'),
