('tv_episode_content_21FNYDK9LyvL6tuzm0d7ILxxIb5mvFBT4u', 'tv_season_content_21QTUUY2XVSWIPEGhWRKdt5gB48PIf9VL4', 'content_21ltEP30PO0yzJmcJZoVog0Q7Mqz0IBUsp', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Takas', 'Ölüm Defteri\'ni insan dünyasına düşüren ölüm tanrısı namıdiğer Ölüm Meleği Ryuk, Light\'ı peşinde biri olduğu konusunda uyarır.', '13916', 'tt0909466', 'https://www.themoviedb.org/t/p/w500/hptAxznwIjWG6IjDfMHMaGkHvAQ.jpg', 1, 3, 1, 8, 0, '2006-10-18', '2021-08-07 10:04:07', '2021-08-07 10:04:08'),
('tv_episode_content_21fOg2rEFXJY6BUntDLi3l4x4e2zdveAmL', 'tv_season_content_21qSlMPpCrDiaSse5DhStgL8Vqq9PatkXq', 'content_21GXYZN2vlp5qB9dDc4wgLAjYUGVs3cVrK', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Surları Aşmak', 'II. Mehmet, Konstantinopolis\'in surlarını yıkmak için şiddetli bir kuşatma başlatır, ancak Giustiniani\'nin paralı askerleri yeniçerilere engel olmayı başarır.', '96481', '#', 'https://www.themoviedb.org/t/p/w500/8PxW0P1YIn0TXV4cy9zes0Pg2d5.jpg', 1, 2, 1, 9, 6, '2020-01-24', '2021-08-05 14:15:47', '2021-08-05 14:15:48'),
('tv_episode_content_21Foz1kqlxGxoqk4x4yaWiCT0kQGbZM3OJ', 'tv_season_content_21qT50mPxsWJtWjPqiRjfaPZG9r67NrDis', 'content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Hizmet', 'Kurtarıcılar, malzemelere el koymak için Alexandria\'ya gelince grup, bir çıkış yolu bulması için Rick\'ten medet umar. Peder Gabriel, fevri davranır.', '1402', 'tt5207730', 'https://www.themoviedb.org/t/p/w500/tjx8ewEfqywQYC4CDgEivy6MFEL.jpg', 7, 4, 1, 7, 0, '2016-11-13', '2021-08-25 19:02:01', '2021-08-25 19:02:07'),
