('tv_episode_content_21FqlWEs6zdpuC2c0jb2PCognt6YpTef9K', 'tv_season_content_21nCkezpbNb7rVCnm0qumkXLpnPyfI6P31', 'content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Lanetliler', 'Daryl ve Rick bir silah zulasını ararken Carol ve Ezekiel kaçan bir Kurtarıcı\'nın peşine düşer. Tara ve Jesus, ellerindeki bir esire acıyıp acımamak konusunda tartışır.', '1402', 'tt6198638', 'https://www.themoviedb.org/t/p/w500/pek9cYNFQ3SmlG1ZfAkfgqPgiet.jpg', 8, 2, 1, 7, 0, '2017-10-29', '2021-08-25 19:02:54', '2021-08-25 19:02:55'),
('tv_episode_content_21fr00S9TNsgycm0rhF1M9szow7SEHrr4B', 'tv_season_content_21bvxjMEGDXnIXqNq6gPOljv8mbYXLtwMj', 'content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Enfeksiyon', 'Bir virüsün yayılmasını önlemek için, hayatta kalan bazı kişiler karantinaya alınır. Carol, iki kızı kanadı altına alır. Tyreese şaşırtıcı bir keşifte bulunur.', '1402', 'tt2931446', 'https://www.themoviedb.org/t/p/w500/nX41xYe00x1E1k4OrnAqhMOWsC9.jpg', 4, 2, 1, 8, 0, '2013-10-20', '2021-08-25 18:59:02', '2021-08-25 18:59:09'),
