('tv_episode_content_21JgHheQ3aTHZ1ZVQzNTVCd0moOcMh4hM4', 'tv_season_content_21eryTGiZuOjcTQNAZEHHxJKU91w403zPu', 'content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Mide Bulandırıcı', 'Rick ve grup, içlerinden birinin hayatını kurtarmak için uğraşırken yeni düşmanların keşfi durumu daha da karmaşık bir hâle getirir.', '1402', 'tt2253598', 'https://www.themoviedb.org/t/p/w500/t4V7qydowNc7VOuIqz5qTstGM0T.jpg', 3, 2, 1, 8, 0, '2012-10-21', '2021-08-25 18:58:04', '2021-08-25 18:58:05'),
('tv_episode_content_21jgyWtPSWlMPHOWW6l51RYEw9KOrI6x7t', 'tv_season_content_21VaRtcnNu7a4K4CJOOWeev797PZ1gBr53', 'content_21dLUEKijjot6unGN4U4heMLXtv7uFJ0Lz', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Metal Kafa', 'Terk edilmiş bir ambarda işlerine yarar malzemeler ararken acımasız bir düşmanla karşılaşan grup, hayatta kalmak için ıssız bir araziden geçerek kaçmak zorundadır.', '42009', 'tt5710984', 'https://www.themoviedb.org/t/p/w500/8mMSk4cGfIftbIoA2Mq83LpzYlw.jpg', 4, 5, 1, 6, 2, '2017-12-29', '2021-08-05 14:30:17', '2021-08-05 14:30:18'),
('tv_episode_content_21JhYbGmfW5BviTUrcW5X9aP8nCgq6Hqfo', 'tv_season_content_21G08K3PY9pLqpMnE2Fl7hiVP4zj7HFIX7', 'content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Hayaletler', 'Baş düşmanıyla karşı karşıya geldiği anı aklından çıkaramayan Carol, intikam arzusunu kontrol etmekte zorlanır. Alexandria ise paranoya ve aylak dalgalarıyla uğraşır.', '1402', 'tt9729152', 'https://www.themoviedb.org/t/p/w500/nOkcmuzFpatH6kBoy6yffq28Sm7.jpg', 10, 3, 1, 7, 0, '2019-10-20', '2021-08-25 19:04:48', '2021-08-25 19:04:49'),
('tv_episode_content_21jIBcK6Ly2FycheMw9vIQLydXJydbW0A7', 'tv_season_content_21pKPW9ADAyTbGXSSrpWLr7wxuR2My2HeF', 'content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Nebraska', 'Grup, korkunç bir keşfin ardından düzeni yeniden sağlamaya çalışır. Hershel ortadan kaybolunca Rick ve Glenn\'in onun peşinden kasabaya gitmesi gerekir.', '1402', 'tt1804272', 'https://www.themoviedb.org/t/p/w500/8I3QhTjrpvsOJ6EVy6c3YK2ZPDK.jpg', 2, 8, 1, 8, 0, '2012-02-12', '2021-08-25 18:57:40', '2021-08-25 18:57:41'),
