('tv_episode_content_21L2abPTyhEnx3uk22mKKnbAUS4ujFKmBO', 'tv_season_content_21gtZwib0F21bEuIh01pHClTbQ5umNKA0O', 'content_2139IN4E0foZQTUhP4qNATnW8XzhV3DEEf', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', '1. Bölüm', '', '69050', 'tt5728914', 'https://www.themoviedb.org/t/p/w500/aJkNfiQVGW5hNhR4C9NWxBdLeDA.jpg', 1, 1, 1, 7, 0, '2017-01-26', '2021-08-25 18:41:51', '2021-08-25 18:41:52'),
('tv_episode_content_21L2fAYA3INtdpJb7LuEirtHMaIDDXRq6E', 'tv_season_content_21TW26iotSYbyZ0JFKva4mI1ObrCICRfDL', 'content_21jS9V5sFiEHX898g5Inhj1kaVQcEJpItC', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', '17. Bölüm', 'Gizemli ve teşhis edilmemiş bir hastalığı olan ve yıllardır diğer doktorları şaşırtan bir hasta, Dr. Shaun Murphy ve ekibi bazı büyük riskler almaya zorluyor.', '71712', 'tt11718904', 'https://www.themoviedb.org/t/p/w500/fYH8ki5p0JXGzLab06cNNe4S08n.jpg', 3, 17, 1, 9, 0, '2020-03-02', '2021-08-25 18:50:56', '2021-08-25 18:50:57'),
