('tv_episode_content_21l6NRBRkk1l6UHNammOinSKDlLp7HZK2p', 'tv_season_content_21YSkiumazT5FuYkrBcvFzdeDOk1j2UQ9N', 'content_21jS9V5sFiEHX898g5Inhj1kaVQcEJpItC', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'We\'re All Crazy Sometimes', 'Dr. Glassman inanılmaz derecede eşsiz ve karmaşık bir omurilik ameliyatını tamamladıktan sonra asistanlara başka ameliyata katılma fırsatı tanır.', '71712', 'tt14048616', 'https://www.themoviedb.org/t/p/w500/q3sdkJoHUZWX7LzmSvtf19sD7DG.jpg', 4, 11, 1, 0, 0, '2021-03-08', '2021-08-25 18:51:47', '2021-08-25 18:51:48'),
('tv_episode_content_21L7VCFkMeyp4MFUgz0JvhveP5g3ozVF1z', 'tv_season_content_21YSkiumazT5FuYkrBcvFzdeDOk1j2UQ9N', 'content_21jS9V5sFiEHX898g5Inhj1kaVQcEJpItC', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', '20. Bölüm', '', '71712', 'tt14597076', 'https://www.themoviedb.org/t/p/w500/5DlE7uIRetvlcmQUPk7HQFp22Fm.jpg', 4, 20, 1, 0, 0, '2021-06-07', '2021-08-25 18:52:16', '2021-08-25 18:52:17'),
('tv_episode_content_21LAcUo0hmeL3gsxxeW7ytTAjRT3yFRaC9', 'tv_season_content_21AjIMDgFsGvcsRxTw26kun0hl0Sz2eggH', 'content_2186CKnNz9CkMS3tC0tTM9kSnvieWL2lsK', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', '12. Bölüm', '', '60735', 'tt4105618', 'https://www.themoviedb.org/t/p/w500/a1r4J8NQaNK24WMJSgCWkPyCvua.jpg', 1, 12, 1, 7, 0, '2015-02-03', '2021-08-25 19:18:21', '2021-08-25 19:18:22'),
('tv_episode_content_21LCLjO4LdQgF0xmt9l933NlxjV1MW2uam', 'tv_season_content_21TmPUGq7cJPGSilXQFCtRA8tcaQ7osZaG', 'content_21YtlHwoKCxUeFZDGyqvUul53gqUOyYpCI', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', '5. Bölüm - Gizeme Yolculuk', 'Sylvie, Renslayer\'dan Loki\'nin, TVA\'nın kuruttuğu her şeyin içine atıldığı zamanın sonunda bir boyut olan boşluğa ışınlandığını öğrenir. Bu arada Loki, diğer varyantlarından Alioth adında bulut benzeri bir yaratığın Void\'i koruduğunu ve kaçmayı engellediğini öğrenir. Loki\'ye ulaşmak için Sylvie kendini yok ederek Mobius\'un yardımıyla Alioth\'tan kıl payı kurtulur. Övünen Loki, başka bir Loki varyantı için diğer Lokilere ihanet etmeye çalışır (kendi zaman çizelgesinde başkan seçilmiştir), bu da Loki\'yi ve varyant müttefiklerini kaçmaya zorlayan bir kavgaya neden olur. Loki ile tekrar bir araya geldikten sonra TVA\'nın yaratılmasının arkasındaki gerçek dehaya götürecek umuduyla.  Sylvie, Alioth\'a yaklaşmak ve onu büyülemek için bir plan önerir.  Çocuk Loki ve Timsah Loki kaçarken Klasik Loki, Alioth\'un dikkatini dağıtmak için büyük bir Asgard yanılsaması yaratır ve bu süreçte kendini feda eder.', '84958', 'tt10161338', 'https://www.themoviedb.org/t/p/w500/5fRAAO13URmteku8mb39V9YPJBb.jpg', 1, 5, 1, 8, 26, '2021-07-07', '2021-07-24 21:42:21', '2021-07-24 21:42:22'),
