('tv_episode_content_21PHrrTT2TWJmUOzR2UQKBRnbbmwaZDm2E', 'tv_season_content_21KvdHjEzVVlhN29FdKCDwIB37rKmrR2Cx', 'content_21VripXgBhDdW9cHytgRlfD4j3fDNBctND', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', '4. Bölüm', 'Söylediği yalanlar ve suçluluk duygusu yüzünden acı çeken adam, tehlikelerle dolu kararlar alır. Elizabeth torununu korumak için devreye girer.', '86430', 'tt10169708', 'https://www.themoviedb.org/t/p/w500/8RWduOBqJDgh2Tzv5ciww3ZMbOo.jpg', 1, 4, 1, 7, 0, '2020-12-27', '2021-08-15 13:59:10', '2021-08-15 13:59:11'),
