('tv_episode_content_21UBwpm9vQq1Mv159xf34IaPKbY0UTo8R1', 'tv_season_content_21qT50mPxsWJtWjPqiRjfaPZG9r67NrDis', 'content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Yeni Dostlar', 'Richard, Kurtarıcılar\'la savaş çıkartmak için plan yapar. Kayıp bir Alexandrialıyı ararken Rick ve diğerleri, tuhaf bir toplumla karşılaşır.', '1402', 'tt5207750', 'https://www.themoviedb.org/t/p/w500/obVUtawmMsiyRwToWgb0t4sBht7.jpg', 7, 10, 1, 7, 0, '2017-02-19', '2021-08-25 19:02:26', '2021-08-25 19:02:27'),
('tv_episode_content_21uc2vDOwZQVPTgDQuNqPcdhfTKnfXBcBV', 'tv_season_content_214bAt9lqqoQy3Y7pN8jQyhuUm0F6SkSPE', 'content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Her Zaman Sorumlu', 'Daryl, sürüyü Alexandria\'dan uzaklaştırırken Abraham ve Sasha\'dan ayrı düşer ve üç yabancıyla karşılaşır.', '1402', 'tt4719674', 'https://www.themoviedb.org/t/p/w500/ivFWhyiDza201a7dcfwLOqf3URt.jpg', 6, 6, 1, 7, 0, '2015-11-15', '2021-08-25 19:01:15', '2021-08-25 19:01:16'),
