('tv_episode_content_21uHFbMzspWmTNZGvbjiiNMiTwQYP8MhTS', 'tv_season_content_21wqI34j1bYJZwR8TIcpP8cw95odg6yJGb', 'content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Dört Duvar ve Bir Çatı', 'Rick ve Sasha\'nın yüzleştiği Peder Gabriel, şaşırtıcı bir itirafta bulunur. Abraham, Washington\'a gitmek için gruba baskı yapar ama Rick beklemek ister.', '1402', 'tt3689244', 'https://www.themoviedb.org/t/p/w500/yq8RC638xv9FIibBIEOmEdV10qA.jpg', 5, 3, 1, 8, 0, '2014-10-26', '2021-08-25 19:00:06', '2021-08-25 19:00:07'),
('tv_episode_content_21UhNJ7WMb3zpPhYovdi1PUoI0bVurk1MH', 'tv_season_content_21eryTGiZuOjcTQNAZEHHxJKU91w403zPu', 'content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'İntihar Kralı', 'Rick, grubun bir üyesini kurtarmaya çalışır. Yeni saldırının ardından Woodbury kargaşa içindedir. Hapishanenin yeni konukları endişe uyandırır.', '1402', 'tt2269550', 'https://www.themoviedb.org/t/p/w500/snuUqlMoAohqHu2eGndRJ05pc3T.jpg', 3, 9, 1, 8, 0, '2013-02-10', '2021-08-25 18:58:26', '2021-08-25 18:58:28'),
