('tv_episode_content_21WHQ9PJbnER73HzTqRYFi1scYCehdK35m', 'tv_season_content_21eryTGiZuOjcTQNAZEHHxJKU91w403zPu', 'content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Mezarlığa Hoş Geldiniz', 'Vali\'nin saldırısı yaklaştıkça Rick ve grup, hapishanenin savunmaya değer olup olmadığını düşünmek zorundadır.', '1402', 'tt2521182', 'https://www.themoviedb.org/t/p/w500/kvXS9UXzk8vbgSAgzTfkaTykzUl.jpg', 3, 16, 1, 8, 0, '2013-03-31', '2021-08-25 18:58:55', '2021-08-25 18:58:56'),
