('tv_episode_content_21Xq7B4CC1bsbeWCt8cPzzuybPxrcc9cWm', 'tv_season_content_21bVhfbbuqvVx2Jx0XBA7xiD6a4V0hOQhI', 'content_21QL75rwN2wP75yTqPS9Vx1JJq2PZ3L22O', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Pilot Bölüm', 'Eski bir tanıdığının vahşice öldürülmesinin ardından, şeytan tüyü taşıyan Lucifer katillerden intikam almaya yemin eder ve beklenmedik bir müttefik edinir.', '63174', 'tt4932378', 'https://www.themoviedb.org/t/p/w500/aSl1ASgOlNkukh0kalKCvGKZeb4.jpg', 1, 1, 1, 8, 0, '2016-01-25', '2021-08-25 19:16:14', '2021-08-25 19:16:15'),
('tv_episode_content_21Xrr6vOBo1WznPvVq1XD9lhjp6Af9imoW', 'tv_season_content_21MWFTtHs0dsXSsX2SJYr1qwT8tfYWGoXR', 'content_2166oKJNytIzFDby3pSKURbbRB3PBED3PQ', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', '12. Bölüm', '', '60625', '#', 'https://www.themoviedb.org/t/p/w500/b8PqWFVfBvNWfTCijOnNV4hRaUc.jpg', 0, 12, 1, 0, 0, '2017-07-11', '2021-08-25 19:11:54', '2021-08-25 19:11:55'),
('tv_episode_content_21xSNhJjDpvNqF4kHa9TfAp4qyBw4BUTTk', 'tv_season_content_21qT50mPxsWJtWjPqiRjfaPZG9r67NrDis', 'content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Tuttuğunu Koparanlar', 'Gregory, Hilltop\'a gelir ve Maggie ile Sasha\'ya gitmelerini emreder. Rick malzeme arayışına çıkarken Carl da başka bir göreve gider.', '1402', 'tt5207732', 'https://www.themoviedb.org/t/p/w500/mGvJ3wtRrjNxrNkLoD6H5ukT8Vv.jpg', 7, 5, 1, 7, 0, '2016-11-20', '2021-08-25 19:02:09', '2021-08-25 19:02:11'),
('tv_episode_content_21XtaZRwmeeCQjYHnZUQ7J8vCDhp8LRjh5', 'tv_season_content_21TW26iotSYbyZ0JFKva4mI1ObrCICRfDL', 'content_21jS9V5sFiEHX898g5Inhj1kaVQcEJpItC', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', '15. Bölüm', 'Herkesin şüphelerine rağmen Shaun, Carly\'nin Lea ile olan arkadaşlığının iyi olacağından umutludur. Ekip, deneysel bir prosedür için iyi bir aday olabilecek genç bir çocuğu tedavi eder.', '71712', 'tt11689722', 'https://www.themoviedb.org/t/p/w500/fmOtYFJ1fBJdCpRz3Gj7WsyUR1B.jpg', 3, 15, 1, 8, 0, '2020-02-17', '2021-08-25 18:50:49', '2021-08-25 18:50:50'),
('tv_episode_content_21XuGO1n9VWUjLGbC0nPmdvzgNCtMuglzT', 'tv_season_content_21kyOI9YwV4W3NDsdbJEzsMO0URxfUX9qt', 'content_21r6k4N56FBDyuSNxnoLRSk9GguPCubUPy', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', '16. Bölüm', '', '73106', '#', '/static/img/defaults/poster_episode.png', 1, 16, 1, 0, 0, '2011-09-02', '2021-08-25 19:09:18', '2021-08-25 19:09:19'),
('tv_episode_content_21xvDI1Sdm0rxf87d9dT0FJNQhoz2YpPlc', 'tv_season_content_21rfPHIFv6itHahJR4v48AVlRe9MdBW1Ec', 'content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Geçmiş Günahlar', 'Michonne ayakta kalmaya çalışır. Maggie\'nin planlarını öğrenen Rick\'in sabrı taşar. Bunun ardından Rick, Daryl ile yüzleşir. Hem isyan hem de sürü giderek yaklaşmaktadır.', '1402', 'tt8244690', 'https://www.themoviedb.org/t/p/w500/sxUzTyvKwR7124E10xAqG021eII.jpg', 9, 4, 1, 7, 0, '2018-10-28', '2021-08-25 19:03:57', '2021-08-25 19:03:58'),
('tv_episode_content_21XvKGiriX6z540BN9Jz6Kmz4pCFjT14df', 'tv_season_content_21nCkezpbNb7rVCnm0qumkXLpnPyfI6P31', 'content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Gazap', 'Liderler intikam hırslarının mı, barışçıl bir gelecek umudunun mu daha önemli olduğuna karar verirken müttefikler, Kurtarıcılar\'a karşı son bir saldırıda birlik olur.', '1402', 'tt6337120', 'https://www.themoviedb.org/t/p/w500/avqvqYU1576fFlmYM3auLmcowZL.jpg', 8, 16, 1, 7, 0, '2018-04-15', '2021-08-25 19:03:44', '2021-08-25 19:03:45'),
