('tv_season_content_21qlkHuEiN4TJo9n5O4m7bNhE0ntBBsoaC', 'content_2139IN4E0foZQTUhP4qNATnW8XzhV3DEEf', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Sezon 4', '', '69050', 'https://www.themoviedb.org/t/p/w300/4X7o1ssOEvp4BFLim1AZmPNcYbU.jpg', 4, 1, 0, '2019-10-09', '2021-08-25 18:45:19', '2021-08-25 18:45:21'),
('tv_season_content_21qSlMPpCrDiaSse5DhStgL8Vqq9PatkXq', 'content_21GXYZN2vlp5qB9dDc4wgLAjYUGVs3cVrK', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Sezon 1', 'Osmanlı Sultanı II. Mehmet, Bizans\'ın başkenti Konstantinopolis\'i fethetmek üzere destansı bir sefere çıkar ve tarihin akışını yüzyıllar boyunca değiştirir.', '96481', 'https://www.themoviedb.org/t/p/w300/m2zTiFhrrZVeS4PoIi63YEq3EEM.jpg', 1, 1, 10, '2020-01-24', '2021-08-05 14:15:43', '2021-08-05 14:15:44'),
('tv_season_content_21qT50mPxsWJtWjPqiRjfaPZG9r67NrDis', 'content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Sezon 7', 'Vahşi bir şiddet eylemi, Rick\'in grubunu sarsar. Grup, Negan ve Kurtarıcılar\'ın onlar için başka hangi dehşetli olayları hazırladığını merak eder.', '1402', 'https://www.themoviedb.org/t/p/w300/fz6LidJF4Ue3gspFCKtxCERMCM4.jpg', 7, 1, 0, '2016-10-23', '2021-08-25 19:01:50', '2021-08-25 19:01:51'),
('tv_season_content_21QTUUY2XVSWIPEGhWRKdt5gB48PIf9VL4', 'content_21ltEP30PO0yzJmcJZoVog0Q7Mqz0IBUsp', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Sezon 1', 'Gizemli bir deftere sahip olan Japon lise öğrencisi, deftere adını yazdığı herkesi öldürme gücüne sahip olduğunu fark eder.', '13916', 'https://www.themoviedb.org/t/p/w300/38HkVCV9DFiVhW35l3wEAJFGI5i.jpg', 1, 1, 11, '2006-10-04', '2021-08-07 10:04:00', '2021-08-07 10:04:00'),
