('tv_season_content_21ut61cFMGfCvYNQsyqrDP9hbJXbSleTmA', 'content_2166oKJNytIzFDby3pSKURbbRB3PBED3PQ', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Sezon 2', '', '60625', 'https://www.themoviedb.org/t/p/w300/xcYamBmQmSCpl9L1B5ihesnR1Gb.jpg', 2, 1, 0, '2015-07-26', '2021-08-25 19:13:16', '2021-08-25 19:13:16'),
('tv_season_content_21VaRtcnNu7a4K4CJOOWeev797PZ1gBr53', 'content_21dLUEKijjot6unGN4U4heMLXtv7uFJ0Lz', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Sezon 4', 'Teknolojinin karanlık yüzünü anlatan bu masallarda bir fantezi kontrolden çıkıyor, her şeyi gören cihazlar karanlık sırları açıklıyor ve bir kadın bir avcıdan kaçıyor.', '42009', 'https://www.themoviedb.org/t/p/w300/nqgx6I9qPiCpdy7u3HFR8DH2cWq.jpg', 4, 1, 2, '2017-12-29', '2021-08-05 14:30:02', '2021-08-05 14:30:03'),
('tv_season_content_21wqI34j1bYJZwR8TIcpP8cw95odg6yJGb', 'content_21hCvR2PuZcJ6ix9FrwcGrqusxgCaKASay', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Sezon 5', '5. sezonda Rick ve diğerleri, kendilerini esir alanlarla yüzleşir, Beth\'e olanları öğrenir ve yeni bir gruba güvenip güvenmeyeceklerine karar vermek zorunda kalır.', '1402', 'https://www.themoviedb.org/t/p/w300/oiQbg5WqdHqBWMrtbzJeS6vb2Lt.jpg', 5, 1, 0, '2014-10-12', '2021-08-25 18:59:57', '2021-08-25 18:59:58'),
('tv_season_content_21XL5NGbvburJddIz6spZaEud4wmsxJVl7', 'content_21dLUEKijjot6unGN4U4heMLXtv7uFJ0Lz', 'profile_21FH9bMeJo879PmtGhR6Cl2xsjQhekQrjU', 'account_21CYA3LMqukbTEv9A73RgTezCWLxzBwOcA', 'Sezon 1', 'Bu bilimkurgu antolojisi dizisi, insanların var olabilmek için puan topladığı, hafıza implantları taktırdığı ve çok daha fazlasının gerçek olduğu bir dünyada geçiyor.', '42009', 'https://www.themoviedb.org/t/p/w300/eE7fAb7qoheUageST2PBdpoZ3D1.jpg', 1, 1, 3, '2011-12-04', '2021-08-05 14:29:22', '2021-08-05 14:29:22'),
